  "text" : "\uAC4D \uBC11\uB3C4 \uB05D\uB3C4 \uC5C6\uC774 \"\uC5EC\uC790\uB3C4 \uC804\uBD80 \uB370\uB824\uB2E4\uAC00 \uAD70\uBCF5\uBB34\uB97C \uC2DC\uCF1C\uC57C \uD558\uACE0, \uADF8\uAC8C \uC548\uB418\uBA74 \uAD70\uB300\uB97C \uAC00\uC9C0 \uC54A\uB294 \uAC83\uC774 \uD604\uBA85\uD55C \uC120\uD0DD\uC774\uB2E4!\" \uB530\uC704\uC758 \uC18C\uB9AC\uB97C \uD558\uACE0 \uC788\uB098.. \uC544\uB2C8 \uC9C0\uAE08 \uAD70\uB300\uAC00 \uC5EC\uC131\uC744 \uC758\uBB34\uBCF5\uBB34\uC790\uC6D0\uC73C\uB85C \uBCF4\uC9C0 \uC54A\uB294 \uAC00\uC7A5 \uD070 \uC774\uC720 \uC911 \uD558\uB098\uAC00 \uD604\uC2DC\uC810\uC5D0\uC11C\uB294 \uB0A8\uC131\uB9CC\uC73C\uB85C\uB3C4",
