  "text" : "\uC790\uAE30\uC8FC\uC7A5\uC5D0 \uC720\uB9AC\uD55C \uC815\uBCF4\uB9CC\uC744 \uC120\uD0DD\uC801\uC73C\uB85C \uC218\uC6A9\uD558\uACE0, \uBCF4\uACE0 \uC2F6\uC740 \uAC83\uB9CC \uBCF4\uB294 \uC2EC\uAC01\uD55C \uC815\uBCF4\uCC98\uB9AC\uC758 \uC624\uB958\uB97C \uB0B3\uC558\uB2E4. \uAD70\uAC00\uC0B0\uC810\uC81C \uD3D0\uC9C0\uB098 \uBD80\uD65C\uC744 \uBC18\uB300\uD558\uB294 \uCE21\uC5D0\uC11C \uB354 \uC801\uADF9\uC801\uC73C\uB85C \uB300\uC548\uC744 \uC81C\uC2DC\uD558\uACE0 \uC788\uB294 \uC0C1\uD669\uC784\uC5D0\uB3C4 \uC774\uB4E4\uC758 \uC8FC\uC7A5\uC774 \uC81C\uB300\uB85C \uC8FC\uBAA9\uBC1B\uC9C0 \uBABB\uD558\uAC70\uB098 \uC758\uC81C\uD654\uB418\uC9C0 \uBABB\uD558\uB294",
