  "text" : "\uB0A8\uC131\uB4E4\uC758 \uBD88\uB9CC\uC740 \uBD84\uB178\uB85C \uCE58\uB2EB\uACE0 \uC788\uC5C8\uB2E4.\n\n\uB0A8\uC131\uB4E4\uC758 \uBD84\uB178 \uD3ED\uBC1C\uC740 \uC5C9\uB6B1\uD55C \uBC29\uD5A5\uC73C\uB85C \uD5A5\uD558\uC600\uB2E4. \uB0A8\uC131\uB4E4\uC758 \uBD84\uB178\uB294 \uBC15\uD0C8\uAC10\uC744 \uC548\uACA8 \uC900 \uB0A8\uC131 \uB0B4\uBD80\uC758 \uD2B9\uAD8C\uCE35\uC774 \uC544\uB2C8\uB77C \uB610 \uB2E4\uB978 \uC0AC\uD68C\uC801 \uC57D\uC790\uC778 \uC5EC\uC131\uC744 \uD5A5\uD574 \uD45C\uCD9C\uB418\uC5C8\uB2E4.\n\n1999\uB144\uC5D0 \u2018\uC81C\uB300\uAD70\uC778\uC9C0\uC6D0\uC5D0 \uAD00\uD55C \uBC95\uB960\u2019\uC5D0 \uB300\uD55C",
