  "text" : "\u2018\uAC00\uACE0 \uC2F6\uC9C0 \uC54A\uC740 \uAD70\uB300\u2019, \u2018\uB04C\uB824\uAC00\uC57C \uD558\uB294 \uD798\uB4E0 \uAD70\uB300\u2019\uB77C\uB294 \uC774\uBBF8\uC9C0\uB294 \uACFC\uAC70\uC640 \uD06C\uAC8C \uB2EC\uB77C\uC9C0\uC9C0 \uC54A\uC558\uB2E4. \uC81C\uB300 \uD6C4\uC5D0\uB294 \uB108\uBB34\uB098\uB3C4 \uB2EC\uB77C\uC9C4 \uC0AC\uD68C\uC5D0 \uC801\uC751\uD574\uC57C \uD558\uACE0 \uD6CC\uCA4D \uB192\uC544\uC9C4 \uCDE8\uC5C5 \uC7A5\uBCBD\uACFC \uB192\uC740 \uCCAD\uB144\uC2E4\uC5C5\uB960\uC774\uB77C\uB294 \uC88C\uC808\uC801\uC778 \uD658\uACBD, \uD2B9\uAD8C\uCE35\uC5D0 \uB300\uD574 \uB290\uB07C\uB294 \uBC15\uD0C8\uAC10\uC774 \uC911\uCCA9\uB418\uBA74\uC11C",
