  "text" : "\uAD70\uB300\uC5D0 \uAC00\uB294 \uAC83\uC774 \uD798\uC5C6\uACE0 \uBE7D\uC5C6\uC74C\uC744 \uC0C1\uC9D5\uD558\uB294 \uAC83\uC73C\uB85C \uBCC0\uC9C8\uB418\uC5B4 \uAC14\uB2E4. \uC18C\uC704 \uAD70 \uBA74\uC81C\uC790\uB294 \u2018\uC2E0\uC758 \uC544\uB4E4\u2019\uC774\uACE0, \uD604\uC5ED\uBCF5\uBB34\uC790\uB294 \u2018\uC5B4\uB460\uC758 \uC790\uC2DD\uB4E4\u2019\uC774\uB77C\uB294 \uC720\uD589\uC5B4\uC5D0\uC11C \uBCF4\uB4EF\uC774 \uD604\uC5ED \uBCF5\uBB34\uC790\uAC00 \uC624\uD788\uB824 \uC57D\uC790\uB77C\uB294 \uC778\uC2DD, \uC774\uAC83\uC774 \uACC4\uCE35 \uAC04\uC758 \uC0C1\uB300\uC801 \uBC15\uD0C8\uAC10\uC744 \uB300\uBCC0\uD558\uB294 \uAC83\uC774 \uB418\uC5C8\uB2E4.",
