  "text" : "\uBCD1\uC5ED\uAE30\uD53C \uC758\uD639\uACFC \uAD6D\uC801\uBB38\uC81C\uAC00 \uBE48\uBC88\uD558\uAC8C \uBD88\uAC70\uC9C0\uBA74\uC11C \uAD70\uB300\uB294 \uB300\uD55C\uBBFC\uAD6D \uB0A8\uC131\uC774\uBA74 \uB204\uAD6C\uB098 \uB611\uAC19\uC774 \uAC00\uB294 \uACF3\uC774 \uC544\uB2C8\uB77C\uB294 \uC778\uC2DD\uC774 \uAE09\uC18D\uD788 \uD37C\uC838 \uB098\uAC14\uB2E4. \uB610\uD55C \uAC19\uC740 \uD604\uC5ED \uBCF5\uBB34\uC790 \uC911\uC5D0\uC11C\uB3C4 \uBD80\uB300\uBC30\uCE58\uB098 \uBCF4\uC9C1\uBC30\uCE58\uC5D0\uC11C \uAE30\uC874\uC758 \uC0AC\uD68C\uACC4\uCE35\uACFC \uD559\uB825\uC774 \uD22C\uC601\uB418\uC5B4 \uB098\uD0C0\uB098\uB294 \uD604\uC2E4\uC744 \uBCF4\uBA74\uC11C",
