  "text" : "\uBC15\uD0C8\uAC10\uACFC \uC0C1\uC2E4\uAC10\uC73C\uB85C \uB2E4\uAC00 \uC654\uACE0, \uADF8 \uB3D9\uC548 \uB9C8\uC74C\uC18D \uAE4A\uC774 \uC7A0\uC7AC\uB418\uC5C8\uB358 \uBD84\uB178\uC758 \uD3ED\uBC1C\uB85C \uC774\uC5B4\uC9C0\uB294 \uACC4\uAE30\uAC00 \uB418\uC5C8\uB2E4.\n\n\uBCD1\uC5ED\uBE44\uB9AC \uBB38\uC81C\uB294 \uBBFC\uC8FC\uD654 \uC774\uD6C4, 1997\uB144\uACFC 2002\uB144 \uB300\uC120 \uADF8\uB9AC\uACE0 \uACF5\uC9C1\uC790 \uC784\uBA85\uC744 \uC704\uD55C \uAC01\uC885 \uCCAD\uBB38\uD68C \uB4F1\uC744 \uD1B5\uD574 \uD6C4\uBCF4\uC790 \uB2F9\uC0AC\uC790 \uBC0F \uADF8 \uC544\uB4E4\uB4E4\uC758",
