  "text" : "\uADF8\uB7EC\uB098 \uB450 \uAC00\uC9C0 \uCEE4\uB2E4\uB780 \uC774\uC288\uAC00 \uB4F1\uC7A5\uD568\uC73C\uB85C\uC368 \uC774\uB7EC\uD55C \uADE0\uD615 \uC0C1\uD0DC\uB97C \uB4A4\uD754\uB4E4\uC5B4 \uB193\uB294 \uACC4\uAE30\uAC00 \uB418\uC5C8\uB2E4. \uD558\uB098\uB294 \uC0AC\uD68C \uC9C0\uB3C4\uCE35\uC758 \uBCD1\uC5ED\uBE44\uB9AC \uBB38\uC81C\uC774\uACE0, \uB2E4\uB978 \uD558\uB098\uB294 \uAD70\uAC00\uC0B0\uC810\uC81C\uB3C4\uC758 \uD3D0\uC9C0\uC600\uB2E4. \uC774 \uB450 \uAC00\uC9C0 \uC774\uC288\uB294 \uAD70\uBCF5\uBB34\uB97C \uB9C8\uCE5C \uB0A8\uC131\uACFC \uAD70\uBCF5\uBB34\uB97C \uC55E\uB450\uACE0 \uC788\uB294 \uB0A8\uC131\uB4E4\uC5D0\uAC8C",
