  "text" : "\uAD70\uBCF5\uBB34\uB97C \uB9C8\uCE5C \uB0A8\uC131\uC5D0\uAC8C \uC720\u2024\uBB34\uD615\uC758 \uD61C\uD0DD\uC744 \uC8FC\uB294 \uAD00\uD589\uC774 \uC790\uB9AC \uC7A1\uACE0 \uC788\uB2E4. \uADF8\uAC83\uC740 \uBC14\uB85C \uC804\uC778\uACA9\uC801\uC778 \uC9D5\uBC1C\uC758 \uBD80\uC0B0\uBB3C\uB85C\uC11C \uD798\uB4E0 \uAD70\uB300\uC0DD\uD65C\uC744 \uD1B5\uD574 \uAE4E\uC774\uACE0 \uB2E4\uB4EC\uC5B4\uC84C\uC744 \u2018\uC778\uB0B4\uC2EC\u2019\uACFC \u2018\uC870\uC9C1 \uC801\uC751\uB825\u2019, \u2018\uC6D0\uB9CC\uD55C \uB300\uC778\uAD00\uACC4 \uB2A5\uB825\u2019 \uB4F1\uC744 \uAE30\uB300\uD55C \uB370\uC5D0\uC11C \uBE44\uB86F\uB418\uC5C8\uC744 \uAC83\uC774\uB2E4.",
