  "text" : "\uBCD1\uC5ED\uC744 \uD68C\uD53C\uD558\uAE30 \uC704\uD574 \uBA74\uC81C \uC0AC\uC720\uB97C \uC77C\uBD80\uB7EC '\uB9CC\uB4DC\uB294 \uAC83'\uC774 \uC704\uBC95\uC785\uB2C8\uB2E4. \uD3B8\uBC95\uC774 \uBB54\uC9C0 \uC804\uD600 \uBAA8\uB974\uACE0 \uACC4\uC2DC\uB294 \uAC83 \uAC19\uC740\uB370\uC694. \uD3C9\uC0C1\uC2DC \uB274\uC2A4\uB9CC \uC798 \uBCF4\uACE0 \uC0AC\uC168\uC5B4\uB3C4 \uCDA9\uBD84\uD788 \uC54C \uC218 \uC788\uB294 \uAC1C\uB150\uC778\uB370 \uC2AC\uD504\uB124\uC694\n\n@entalphy312 http:\/\/t.co\/PihM3k97cB",
