  "text" : "\uAC00\uB9CC\uD788 \uC9C0\uCF1C\uBCF4\uACE0 \uC788\uC790\uBA74.. \uC800\uBD84\uB4E4\uC740 \uBCD1\uC758 \uCC98\uC6B0 \uAC1C\uC120\uC774\uB098 \uC2E4\uC9C8\uC801 \uBD88\uD3C9\uB4F1 \uBB50 \uADF8\uB7F0 \uAC83\uC5D0\uB294 \uAD00\uC2EC\uC774 \uC5C6\uACE0, \uADF8\uC800 \uAD70\uAC00\uC0B0\uC810\uC81C\uB3C4\uC640 \uB0A8\uC131\uB9CC\uC758 \uBCD1\uC5ED\uC758\uBB34\uAC00 '\uC5EC\uC790\uB97C \uAE4C\uAE30 \uC88B\uC740 \uC218\uB2E8\uC774\uAE30\uC5D0' \uC5EC\uAE30\uC5D0 \uC624\uC9C1 '\uAC10\uC815\uC801\uC73C\uB85C', '\uC7AC\uBBF8\uC0BC\uC544' \uB9E4\uB2EC\uB9AC\uACE0 \uC788\uB2E4\uB294 \uC0DD\uAC01\uC774 \uB4DC\uB294 \uAC83\uC774 \uC0AC\uC2E4",
