  "text" : "\uBA85\uBC31\uD55C \uC131\uCC28\uBCC4\uC758 \uD76C\uC0DD\uC790\uC600\uB2E4. (\uC774\uB7EC\uD55C \uB0A8\uB140\uBD84\uB9AC \uACF5\uBB34\uC6D0\uCC44\uC6A9\uC81C\uB3C4\uB294 1989\uB144 \uACF5\uBB34\uC6D0\uC784\uC6A9\uC2DC\uD5D8\uB839\uC758 \uAC1C\uC815\uC73C\uB85C \uD3D0\uC9C0\uB418\uC5C8\uACE0, \uC774\uD6C4 \uC5EC\uC131\uACF5\uBB34\uC6D0\uC758 \uBE44\uC728\uC774 \uAE09\uACA9\uD788 \uC99D\uAC00\uD558\uAE30 \uC2DC\uC791\uD558\uC600\uB2E4. \uADF8\uB7EC\uB098 \uC774\uBBF8 20\uC5EC\uB144 \uB3D9\uC548 \uACC4\uC18D\uB41C \uC81C\uD55C\uC73C\uB85C \uC778\uD558\uC5EC \uC5EC\uC131\uACF5\uBB34\uC6D0\uC758 \uACE0\uC704\uC9C1\uC9C4\uCD9C\uC758 \uC0AC\uB840\uB294",
