  "text" : "\uC138\uACC4 \uCD5C\uD558\uC704\uAD8C\uC744 \uD615\uC131\uD558\uACE0 \uC788\uB2E4. \uC774\uB294 \uADF8\uB3D9\uC548 \uACF5\uC9C1\uC784\uC6A9\uC758 \uAE30\uD68C\uBFD0\uB9CC \uC544\uB2C8\uB77C \uACE0\uC704 \uACF5\uC9C1\uC9C4\uCD9C\uC758 \uAE30\uD68C\uAC00 \uC5EC\uC131\uC5D0\uAC8C \uAC70\uC758 \uBD09\uC1C4\uB418\uC5B4 \uC654\uB2E4\uB294 \uAC83\uC744 \uBCF4\uC5EC\uC900\uB2E4. \uD55C\uAD6D\uC5D0\uC11C \uC5EC\uC131\uC740 1968~1989\uB144 \uACF5\uBB34\uC6D0\uCC44\uC6A9\uC2DC \uB0A8\uB140\uAD6C\uBD84\uBAA8\uC9D1 \uBC0F \uC815\uC6D0\uC758 10%\uC774\uB0B4\uC5D0\uC11C\uB9CC \uC120\uBC1C\uD558\uB294",
