  "text" : "\uC0AC\uD68C\uC801 \uC57D\uC790 \uADF8\uB8F9\uC5D0 \uB300\uD55C \uC801\uADF9\uC801 \uC870\uCE58\uC758 \uADFC\uAC70\uC870\uD56D\uC73C\uB85C \uD574\uC11D\uB420 \uC218 \uC788\uB2E4.\r\uAD70\uAC00\uC0B0\uC810\uC81C \uC704\uD5CC\uACB0\uC815\uC5D0\uC11C \uD5CC\uBC95\uC7AC\uD310\uC18C\uB294 \uC774 \uC810\uC744 \uD2B9\uBCC4\uD788 \uAC15\uC870\uD55C \uBC14 \uC788\uB2E4.\n\n\uACFC\uAC70\uC5D0\uB294 \uB9D0\uD560 \uAC83\uB3C4 \uC5C6\uACE0 \uC624\uB298\uB0A0\uC5D0 \uC774\uB974\uAE30\uAE4C\uC9C0 \uD55C\uAD6D\uC0AC\uD68C\uC758 \uC131\uCC28\uBCC4\uC801 \uAD00\uD589\uACFC \uAD6C\uC870\uB294 \uC5EC\uC804\uD558\uB2E4.",
