  "text" : "\uC0AC\uD68C\uC801 \uAC15\uC790\uC5D0 \uC18D\uD574\uC654\uC73C\uBBC0\uB85C, \uC5ED\uC0AC\uC0C1 \uC774 \uADF8\uB8F9\uC774 \uC801\uADF9\uC801 \uC870\uCE58\uC758 \uB300\uC0C1\uC73C\uB85C \uCDE8\uAE09\uB41C \uC801\uC774 \uC5C6\uC74C\uC744 \uC720\uC758\uD558\uC5EC\uC57C \uD55C\uB2E4. \uBC18\uB300\uB85C \uC6B0\uB9AC \uD5CC\uBC95\uC740 \uBA85\uC2DC\uC801\uC73C\uB85C \uC0AC\uD68C\uC801 \uC57D\uC790 \uADF8\uB8F9\uC778 \uC5EC\uC131, \uC7A5\uC560\uC778 \uB4F1\uC744 \uD2B9\uBCC4\uD788 \uBCF4\uD638\uD558\uB294 \uC218\uB9CE\uC740 \uADDC\uC815\uC744 \uB450\uACE0 \uC788\uC5B4, \uC774 \uADDC\uC815\uB4E4\uC774 \uC624\uD788\uB824 \uC774\uB7EC\uD55C",
