  "text" : "\uBC30\uC81C\uB418\uC5B4 \uC628 \uADF8\uB8F9\uC5D0\uAC8C \uD55C\uC2DC\uC801\uC73C\uB85C \uD2B9\uD61C\uB97C \uBD80\uC5EC\uD558\uB294 \uC801\uADF9\uC801 \uC870\uCE58\uAC00 \uBD80\uC5EC\uB418\uC5B4\uC57C \uD55C\uB2E4\uACE0 \uC8FC\uC7A5\uD55C\uB2E4\uBA74, \uC774\uB294 \uBC95\uB9AC\uB97C \uD06C\uAC8C \uC624\uD574\uD55C \uAC83\uC774\uB2E4. \uC0B4\uD3B4\uBCF4\uAC74\uB300 \uC81C\uB300\uAD70\uC778\uADF8\uB8F9\uC5D0 \uC18D\uD558\uB294 \uBE44\uC7A5\uC560 \uB0A8\uC131\uB4E4\uC740 \uC5B8\uC81C\uB098 \uC0AC\uD68C\uC801 \uC8FC\uB958\uADF8\uB8F9\uC744 \uD615\uC131\uD574\uC654\uC73C\uBA70 \uC0AC\uD68C\uC758 \uC758\uC0AC\uACB0\uC815\uACFC\uC815\uC744 \uC9C0\uBC30\uD558\uB294",
