  "text" : "\uC5B4\uB5A0\uD55C \uB2E8\uC11C\uB97C \uBC1C\uACAC\uD560 \uC218 \uC788\uB2E4\uACE0\uB294 \uB3C4\uC800\uD788 \uBCFC \uC218 \uC5C6\uB2E4. \uB354\uC6B1\uC774 \uD5CC\uBC95 \uC81C39\uC870 \uC81C2\uD56D\uC744 \uADFC\uAC70\uB85C, \uC81C\uB300\uAD70\uC778\uC744 \uD558\uB098\uC758 \uADF8\uB8F9\uC73C\uB85C \uBB36\uC5B4\uC11C \uB2E4\uB978 \uADF8\uB8F9, \uC608\uCEE8\uB300 \uC5EC\uC131\uC774\uB098 \uC7A5\uC560\uC778 \uADF8\uB8F9\uACFC \uAC19\uC774 \uC5ED\uC0AC\uC801\u2022\uC0AC\uD68C\uC801\u2022\uBB38\uD654\uC801\uC73C\uB85C \uC7A5\uAE30\uAC04 \uCC28\uBCC4\uB300\uC6B0\uB97C \uBC1B\uC544 \uC624\uBA74\uC11C \uC0AC\uD68C\uC801 \uC758\uC0AC\uACB0\uC815\uC5D0\uC11C",
