  "text" : "\uBB3C\uB860 \uD310\uACB0\uBB38\uC744 \uAC80\uC0C9\uD558\uB294 \uAC83\uC774 \uC5B4\uB824\uC6B8\uC218\uB3C4 \uC788\uACE0- \uD310\uACB0\uBB38\uC744 \uC774\uD574\uD558\uB294 \uAC83\uC774 \uC5B4\uB824\uC6B8 \uC218 \uC788\uB2E4\uB294 \uC810\uC740 \uBD80\uC815\uD560 \uC218 \uC5C6\uB2E4\uB294 \uAC83\uC774 \uC0AC\uC2E4\uC774\uC9C0\uB9CC.. \uC2E4\uC81C \uD310\uACB0\uBB38\uC5D0\uC120 \uADF8\uB807\uAC8C \uD310\uB2E8\uC744 \uD55C \uC801\uC774 \uC5C6\uB294\uB370 \uC790\uAE30 \uBA4B\uB300\uB85C \uD310\uACB0\uBB38 \uB0B4\uC6A9\uC744 \uC720\uCD94\uD558\uAC70\uB098 \uC6B0\uACA8\uB300\uC9C0 \uB9D0\uC558\uC73C\uBA74 \uC88B\uACA0\uB2E4\uAD6C\uC694.",
