  "text" : "\uBAA8\uB974\uACA0\uB2E4. \uB0B4\uAC00 \uADF8\uB7F0 \uBD80\uC815\uC801\uC778 \uBAA8\uC2B5\uB4E4\uB9CC \uBD10\uC640\uC11C \uC774\uB7F0 \uC0DD\uAC01\uC744 \uAC00\uC9C0\uAC8C \uB41C \uAC83\uC778\uC9C4 \uBAA8\uB974\uACA0\uB294\uB370, \uB0A8\uC790\uB4E4\uB9CC \uC758\uBB34\uBCF5\uBB34\uB97C \uD574\uC11C \uC190\uD574\uB97C \uBC1B\uACE0 \uC788\uC73C\uB2C8 \uC5EC\uC790\uB4E4\uB3C4 \uC758\uBB34\uBCF5\uBB34\uB97C \uC2DC\uCF1C\uC57C \uD55C\uB2E4\uB294 \uC8FC\uC7A5\uC740 \uADF8\uC57C\uB9D0\uB85C \uD5EC\uAC8C\uC774\uD2B8\uAC00 \uC5F4\uB9AC\uB294 \uC18C\uB9AC\uB85C\uBC16\uC5D0 \uC548 \uB4E4\uB9AC\uB354\uB77C\uAD6C.",
