  "text" : "\uB0A8\uC790 \uB3D9\uAE30\uC0DD\uACFC \uB611\uAC19\uC774 \uAD50\uC721\uBC1B\uACE0 \uBCD1\uACFC \uC120\uD0DD\uD574\uC11C \uC784\uAD00\uD588\uB294\uB370 \uB3D9\uAE30\uC0DD \uB0A8\uC790\uB9CC \uD6E8\uC52C \uBE60\uB974\uAC8C \uC9C4\uAE09\uB418\uB294 \uACBD\uC6B0\uB3C4 \uB9CE\uACE0, \uB611\uAC19\uC740 \uC2E4\uC218\uB97C \uC800\uC9C8\uB7EC\uB3C4 \"\uC774\uB798\uC11C \uC5EC\uC790\uB294..\" \uC2DD\uC758 \uC18C\uB9AC\uB97C \uB4E3\uB294 \uACBD\uC6B0\uB3C4 \uB9CE\uACE0, \uC5EC\uC790\uB77C\uB294 \uC774\uC720\uB9CC\uC73C\uB85C \uC74C\uC2DD\uC774\uB098 \uC7A5\uC2DD\uD558\uB294 \uC77C \uB4F1\uC5D0 \uC6B0\uC120\uC801\uC73C\uB85C \uD22C\uC785\uB418\uACE0..",
