  "text" : "\uC9C0\uAE08\uB3C4 \uBCD1\uC758 \uAE09\uC5EC\uAC00 \uBCD1\uC7A5 \uC815\uB3C4\uB294 \uB418\uC5B4\uC57C \uADF8\uB098\uB9C8 12~13\uB9CC\uC6D0 \uC77C\uD150\uB370, \uADF8\uB7F0 \uC554\uC6B8\uD55C \uC0C1\uD669\uC5D0\uC11C \uC5EC\uC131\uAE4C\uC9C0 \uC758\uBB34\uBCF5\uBB34\uB97C \uC2DC\uD0A8\uB2E4\uBA74 \uADF8\uB550 \uAE09\uC5EC\uB85C \uB300\uCCB4 \uC5BC\uB9C8\uB97C \uC904\uAC74\uB370.. \uC9C0\uAE08\uC758 \uC5FF\uAC19\uC740 \uD604\uC2E4\uC744 \uBCF8\uACA9\uC801\uC778 \uC9C0\uC625\uC73C\uB85C \uB9CC\uB4E4\uC5B4 \uBCF4\uACA0\uB2E4\uB294 \uC18C\uB9AC\uC778\uAC00. \uD53C\uD560 \uC218 \uC5C6\uB2E4\uBA74 \uC990\uAE30\uAC8C?",
