  "text" : "\uC81C\uB300\uAD70\uC778\uC774 \uAD70\uBCF5\uBB34\uB85C \uC778\uD574 \uACBD\uC81C\uC801\u00B7\uC0AC\uC2E4\uC801 \uBD88\uC774\uC775\uC744 \uBC1B\uB294 \uAC83\uC740 \uC5C4\uC5F0\uD55C \uD604\uC2E4\uC774\uACE0, \uC774\uB7EC\uD55C \uBD88\uC774\uC775\uB4E4\uC740 \uC0AC\uBCD1\uC758 \uCC98\uC6B0\uAC1C\uC120\uC774\uB098 \uAE09\uC5EC \uD604\uC2E4\uD654, \uAC01\uC885 \uC81C\uB3C4\uC801 \uC9C0\uC6D0 \uB4F1\uC744 \uD1B5\uD574 \uD574\uACB0\uD558\uB824\uACE0 \uC0DD\uAC01\uD574\uC57C \uD558\uB294\uB370, \uADF8\uAC8C \uC544\uB2C8\uB77C \uAC19\uC774 \uC5FF\uC744 \uBA39\uC790\uB294 \uD558\uD5A5\uD3C9\uC900\uD654\uB85C \uD574\uACB0\uD558\uB824 \uB4E4\uBA74 \uC5B4\uCA4C\uC790\uACE0",
