  "text" : "\uD3C9\uB4F1\uAD8C\uC774\uB77C\uB294 \uAC83\uC774 \uBAA8\uB4E0 \uAC83\uC744 \uBB34\uC870\uAC74 \uB611\uAC19\uC774 \uCDE8\uAE09\uD560 \uAC83\uC744 \uC694\uAD6C\uD560 \uAD8C\uB9AC\uB294 \uC544\uB2C8\uC8E0. \uADF8\uB807\uAC8C \uAE30\uACC4\uC801\uC73C\uB85C \uD574\uC11D\uD55C\uB2E4\uBA74 \uB0A9\uC138\uC790\uC758 \uC18C\uB4DD \uC218\uC900\uC5D0 \uB530\uB978 \uCC28\uB4F1 \uACFC\uC138\uB3C4 \uBB34\uC870\uAC74 \uD3C9\uB4F1\uAD8C \uCE68\uD574\uB77C\uACE0 \uBD10\uC57C \uD558\uAC8C.. \uD558\uB098\uD558\uB098 \uCABC\uAC1C\uBCF4\uACE0 \uACE0\uB824\uD574\uC11C \uD569\uB9AC\uC801 \uCC28\uBCC4\uC778\uC9C0\uB97C \uD310\uB2E8\uD574\uC57C\uC9C0..",
