  "text" : "\uCC28\uBCC4\uAE08\uC9C0\uC758 \uC0AC\uC720\uB85C \uC608\uC2DC\uD558\uAE30\uC5D0 \uC774\uB978 \uAC83\uC774\uB2E4. \uADF8\uB7EC\uB098 \uC774\uC640 \uAC19\uC740 \uD5CC\uBC95\uADDC\uC815\uC774 \uB0A8\uC131\uACFC \uC5EC\uC131\uC758 \uCC28\uC774, \uC608\uCEE8\uB300 \uC784\uC2E0\uC774\uB098 \uCD9C\uC0B0\uACFC \uAD00\uB828\uB41C \uC2E0\uCCB4\uC801 \uCC28\uC774 \uB4F1\uC744 \uC774\uC720\uB85C \uD55C \uCC28\uBCC4\uCDE8\uAE09\uAE4C\uC9C0 \uAE08\uC9C0\uD558\uB294 \uAC83\uC740 \uC544\uB2C8\uBA70, \uC131\uBCC4\uC5D0 \uC758\uD55C \uCC28\uBCC4\uCDE8\uAE09\uC774 \uACE7\uBC14\uB85C \uC704\uD5CC\uC758 \uAC15\uD55C \uC758\uC2EC\uC744 \uC77C\uC73C\uD0A4\uB294",
