  "text" : "\uC0DD\uB798\uC801\uC778 \uD2B9\uC9D5\uC73C\uB85C\uC11C \uAC1C\uC778\uC758 \uC778\uAC04\uC73C\uB85C\uC11C\uC758 \uC874\uC5C4\uACFC \uAC00\uCE58\uC5D0 \uC601\uD5A5\uC744 \uBBF8\uCE58\uB294 \uC694\uC18C\uB294 \uC544\uB2C8\uB2E4. \uADF8\uB7FC\uC5D0\uB3C4 \uBD88\uAD6C\uD558\uACE0 \uC5ED\uC0AC\uC801\uC73C\uB85C \uB9E4\uC6B0 \uC624\uB79C \uAE30\uAC04 \uB3D9\uC548 \uB300\uD45C\uC801\uC778 \uCC28\uBCC4\uAC00\uB2A5\uC0AC\uC720\uB85C\uC11C \uC815\uB2F9\uD654\uB418\uC5B4 \uC654\uAE30 \uB54C\uBB38\uC5D0, \uBD88\uD569\uB9AC\uD55C \uCC28\uBCC4\uC744 \uADF9\uBCF5\uD574\uC57C \uD560 \uC808\uC2E4\uD55C \uD544\uC694\uC5D0 \uC758\uD558\uC5EC \uC6B0\uB9AC \uD5CC\uBC95\uC774 \uC774\uB97C",
