  "text" : "\uC815\uCE58\uC640 \uB2EC\uB9AC \uC548\uBCF4\uC758 \uBB38\uC81C\uB294 \uC0DD\uAC01\uBCF4\uB2E4 \uB354 \uB9CE\uC740 \uC0AC\uB78C\uB4E4\uC774 \uBCF4\uC218\uC801\uC73C\uB85C \uB420 \uC218 \uBC16\uC5D0 \uC5C6\uACE0, \uC774\uB7EC\uD55C \uC131\uD5A5\uC740 \uC804\uC7C1\uACFC \uBC18\uACF5\uC81C\uC77C\uC8FC\uC758\uB97C \uACAA\uC5B4\uBCF8 \uB178\uB144\uCE35\uC77C\uC218\uB85D \uD655\uC5F0\uD788 \uB4DC\uB7EC\uB0A8. \uC774\uAC83\uC744 \uAC00\uC9C0\uACE0 \uB4DC\uB9BD\uC744 \uCE5C \uAC83\uC740 \uADF8\uC57C\uB9D0\uB85C \uC5ED\uB9B0\uC744 \uAC74\uB4DC\uB9AC\uB294 \uAC83\uACFC \uB2E4\uB984\uC5C6\uB294 \uC148\uC778\uB370.. \uD558\uD544 \uC774 \uB54C..",
