  "text" : "\uADF8\uB7AC\uB294\uB370.. \uC5F0\uD3C9\uB3C4 \uB4DC\uB9BD \uD55C\uBC29\uC774 \uC9C0\uAE08\uAE4C\uC9C0 \uCC9C\uC8FC\uAD50\uC640 \uC815\uC758\uAD6C\uD604\uC0AC\uC81C\uB2E8\uC774 \uC313\uC544\uC62C\uB838\uB358 \uC2E0\uB8B0\uB97C \uBD80\uB3C4\uCC98\uB9AC \uB418\uAC8C \uB9CC\uB4E4\uC5C8\uC74C.\n\n\uC544\uBB34\uB9AC \uC0AC\uC81C\uC5D0 \uB300\uD55C \uC2E0\uB8B0\uB85C \uB618\uB618 \uBB49\uCE5C \uC5B4\uB974\uC2E0\uB4E4\uC774\uB77C\uB3C4, \uBD81\uD55C\uC758 \uC120\uC81C\uACF5\uACA9\uC5D0 \uC758\uD574 \uAD70\uC778\uACFC \uC2DC\uBBFC\uB4E4\uC774 \uC0AC\uB9DD\uD55C \uCC38\uBCC0\uC744 \uAC00\uC9C0\uACE0 \uCE58\uB294 \uB4DC\uB9BD\uC740 \uC6A9\uB0A9 \uBABB\uD568..",
