  "text" : "\uD3C9\uC18C\uC5D0\uB294 \uB9E4\uC6B0 \uBCF4\uC218\uC801\uC778 \uC131\uD5A5\uC744 \uC9C0\uB2CC \uC5B4\uB974\uC2E0\uB4E4\uB3C4, \uC2E0\uBD80\uB2D8\uAED8\uC11C \uD558\uC2DC\uB294 \uB9D0\uC500\uC744 \uB4E4\uC740 \uB4A4 \uC785\uC7A5(\uBB3C\uB860 \uD574\uB2F9 \uC0AC\uC548\uC5D0 \uB300\uD574\uC11C\uB9CC)\uC744 \uBC14\uAFB8\uB294 \uBAA8\uC2B5\uC744 \uC885\uC885 \uBCFC \uC218 \uC788\uC5C8\uACE0, \uADF8\uB807\uAE30\uC5D0 \uC5BC\uB9C8 \uC804\uC5D0 \uC788\uC5C8\uB358 \uCC9C\uC8FC\uAD50 \uB300\uAD6C\uB300\uAD50\uAD6C\uC640 \uC548\uB3D9\uAD50\uAD6C\uC758 \uC2DC\uAD6D\uC120\uC5B8 \uCC38\uC5EC\uB294 \uB098\uB984 \uD070 \uC758\uBBF8\uAC00 \uC788\uC5C8\uC74C.",
