  "text" : "\uBC94\uC8C4\uC790\uB97C \uB9CC\uB4DC\uB294 \uC0AC\uD68C\uC801 \uC694\uC778\uC744 \uC81C\uAC70\uD558\uACE0 \uAD50\uD654\uAE30\uB2A5\uC744 \uB2E4\uD558\uC9C0 \uBABB\uD558\uB294 \uAD50\uC815\uC2DC\uC124\uC744 \uAC1C\uC120\uD558\uB294 \uAC83\uC774 \uC120\uD589\uB418\uC9C0 \uC54A\uC740 \uC0C1\uD0DC\uC5D0\uC11C \uBC94\uC8C4\uC790\uB97C \uC880 \uB354 \uC5C4\uBC8C\uC5D0 \uCC98\uD558\uACE0 \uC880 \uB354 \uC624\uB79C\uC2DC\uAC04 \uAC00\uB450\uC5B4 \uB454\uB2E4\uACE0 \uD574\uC11C \uC774\uAC83\uC774 \uC5B4\uB5A4 \uD6A8\uACFC\uAC00 \uC788\uB2E4\uACE0 \uBCF4\uAE30 \uC5B4\uB835\uC2B5\uB2C8\uB2E4.\r\uB9E4\uC6B0 \uC6B0\uB824\uC2A4\uB7EC\uC6B4 \uAC83\uC740",
