  "text" : "\uC5CA\uADF8\uC81C \uAC15\uB0A8\uC5D0\uC11C \uAE38\uC744 \uAC77\uB294\uB370, \uBAA9\uC904\uC744 \uD558\uC9C0 \uC54A\uC740 \uC911\uAC04 \uC815\uB3C4 \uD06C\uAE30\uC758 \uAC1C\uAC00 \uAC11\uC790\uAE30 \uB2EC\uB824\uB4E4\uC5B4 \uAE5C\uC9DD \uB180\uB780 \uC77C\uD589\uC774 \uADF8 \uC790\uB9AC\uC5D0 \uC8FC\uC800\uC549\uC544 \uC6B8\uC74C\uC744 \uD130\uD2B8\uB9B0 \uAC83 \uB54C\uBB38\uC5D0 \uB0B4\uAC00 \uC9C0\uAE08 \uD654\uAC00 \uB9CE\uC774 \uB098\uC788\uC74C. \uACAC\uC8FC\uB780 \uC0AC\uB78C\uC740 \uB4A4\uB2A6\uAC8C \uB098\uD0C0\uB098 \"\uBB58 \uADF8\uB7F0\uAC78 \uAC00\uC9C0\uACE0 \uB180\uB77C\uB0D0\"\uB77C\uACE0 \uD574\uC11C \uB354.",
