  "text" : "\uBC94\uC8C4\uACBD\uB825\uBA74\uC5D0\uC11C \uCD08\uBC94\uC790 \uBE44\uC728\uC774 59.5%\uB85C \uB2E4\uB978 \uD615\uBC95\uBC94\uC5D0 \uBE44\uD558\uC5EC \uADF8 \uBE44\uC728\uC774 \uB192\uACE0, \uB3D9\uC885\uC804\uACFC\uB97C \uAC00\uC9C4 \uC0AC\uB78C\uC740 \uAC70\uC758 \uC5C6\uB2E4. \u2462 \uC874\uC18D\uC0B4\uD574\uBC94\uC8C4\uC758 \uD53C\uD574\uC790\uB294 \uC8FC\uB85C \uD53C\uD574\uC790\uC758 \uC9C1\uACC4\uC874\uC18D\uC73C\uB85C, \uC2E4\uBD80\uAC00 41.7%, \uC2E4\uBAA8\uAC00 29.8%\uC600\uB2E4. \uD53C\uD574\uC790\uAC00 \uAC00\uD574\uC790\uC758 \uC9C1\uACC4\uC874\uC18D\uC774\uC5C8\uB358 \uACBD\uC6B0",
