  "text" : "\uC788\uAE30 \uB54C\uBB38\uC5D0, \uBBF8\uAD6D\uC758 \uB300\uB959\uC801 \uD655\uC7A5\uC744 \uC815\uB2F9\uD654\uD558\uAE30 \uC704\uD574\uC11C\uB77C\uBA74 \uD544\uC694\uD55C \uBAA8\uB4E0 \uC218\uB2E8\uC774 \uB3D9\uC6D0\uB41C\uB2E4(Merk, 1963). \uCC28\uBCC4, \uC778\uC885\uC8FC\uC758, \uC0AC\uAE30, \uC808\uB3C4, \uAC15\uAC04, \uB0A9\uCE58, \uC0B4\uC778 \uB4F1\uC774 \u2018\uBA85\uBC31\uD55C \uC0AC\uBA85\u2019\uC744 \uC2E4\uD604\uD558\uB294 \uB370 \uB3C4\uC6C0\uC774 \uB41C\uB2E4\uBA74 \uBC94\uC8C4 \uD589\uC704\uB4E4\uB3C4 \uC218\uC778 \uAC00\uB2A5\uD55C \uAC83\uC73C\uB85C",
