  "text" : "\uC678\uAD6D\uC778 \uCDE8\uAE09\uC744 \uBC1B\uACE0 \uC788\uB2E4. \uC774\uB7EC\uD55C \uAD6C\uBD84\uC744 \uC9C0\uC18D\uC2DC\uD0A4\uAE30 \uC704\uD558\uC5EC \uC608\uBC29\uC801 \uC870\uCC98\uAC00 \uCDE8\uD574\uC9C0\uAE30\uB3C4 \uD55C\uB2E4. \uB530\uB77C\uC11C \uBC30\uCC99\uACFC \uCC28\uBCC4 \uAC19\uC740 \uAD00\uD589\uC774 \uC870\uC9C1\uC801\uC73C\uB85C \uC774\uB8E8\uC5B4\uC9C0\uBA74 \uC2EC\uD55C \uD3B8\uACAC\uACFC \uC99D\uC624\uB294 \uC0AC\uD68C\uC801\uC73C\uB85C \uC815\uB2F9\uD654\uB41C\uB2E4. \uB9CE\uC740 \uC0AC\uB78C\uB4E4\uC758 \uB9C8\uC74C\uC18D\uC5D0 \uC774\uB7EC\uD55C \u2018\uBA85\uBC31\uD55C \uC0AC\uBA85\u2019\uC774 \uC790\uB9AC\uC7A1\uACE0",
