  "text" : "\uC778\uC885\uC801 \uBD88\uC21C\uD568 \uB610\uB294 \uC720\uC0C9\uC778\uC885\uACFC \uAD00\uB828\uC2DC\uCF30\uB2E4. \uC774\uB807\uAC8C \uBBF8\uAD6D \uC5ED\uC0AC\uB294 \uCD08\uAE30\uBD80\uD130 \u2018\uBA85\uBC31\uD55C \uC0AC\uBA85\u2019, \uAE30\uB3C5\uAD50, \uC778\uC885\uC801 \uC815\uCCB4\uC131\uC774 \uBB38\uD654\uC801\uC73C\uB85C \uACB0\uD569\uB418\uC5B4 \uC788\uC5C8\uB2E4. \uC2E4\uC81C\uB85C \uC778\uC885\uC801 \uC6B0\uC6D4\uC8FC\uC758\uB294 \uBBF8\uAD6D\uBB38\uD654\uC5D0 \uAE4A\uC219\uC774 \uCE68\uD22C\uD574 \uC788\uC73C\uBA70, \uBBF8\uAD6D\uC778\uC740 \uACE7 \uBC31\uC778\uC774\uB77C\uB294 \uC0DD\uAC01 \uB54C\uBB38\uC5D0 \uB2E4\uB978 \uC778\uC885\uB4E4\uC740",
