  "text" : "\uACFC\uAC70\uBD80\uD130 \uD604\uC7AC\uAE4C\uC9C0 \uBBF8\uAD6D \uBB38\uD654\uB294 \uC774\uAC19\uC740 \uD3B8\uACAC\uC801 \uC0AC\uACE0\uBC29\uC2DD\uACFC \uAC00\uCE58\uCCB4\uACC4\uB97C \uB0B4\uD3EC\uD558\uACE0 \uC788\uC5C8\uB2E4. \uC989 \uBBF8\uAD6D\uC758 \uC0AC\uD68C\uBB38\uD654\uC5D0\uB294 \uC2EC\uAC01\uD55C \uD3B8\uACAC\uACFC \uCC28\uBCC4\uC774 \uC870\uC9C1\uC801\uC73C\uB85C \uC874\uC7AC\uD558\uACE0 \uC788\uC73C\uBA70 \uC774\uB7EC\uD55C \u2018\uC99D\uC624\uC758 \uBB38\uD654\u2019\uAC00 \uC9C0\uC18D\uC801\uC73C\uB85C \uC0AC\uD68C \uAD6C\uC131\uC6D0\uC758 \uC77C\uBD80\uC778 \uD53C\uD574\uC790\uB4E4\uC744 \uD558\uCC2E\uC740 \uC874\uC7AC\uB85C \uC5EC\uAE30\uB3C4\uB85D",
