  "text" : "\uCC28\uBCC4\uC5D0\uC11C \uC2DC\uC791\uD588\uC9C0\uB9CC \uC774\uB7EC\uD55C \uCC28\uBCC4\uC815\uCC45\uC758 \uADFC\uAC04\uC5D0\uB294 \uD504\uB791\uC2A4 \uB0B4\uAD6D\uC778\uACFC \uC911\uB3D9, \uC544\uD504\uB9AC\uCE74 \uC9C0\uC5ED\uC73C\uB85C\uBD80\uD130 \uC628 \uC678\uAD6D\uC774\uBBFC\uC790 \uAC04\uC758 \uD574\uBB35\uC740 \uAC08\uB4F1, \uB354 \uB098\uC544\uAC00 \uC11C\uB85C\uC5D0 \uB300\uD55C \uC99D\uC624\uC2EC\uC774 \uC790\uB9AC \uC7A1\uACE0 \uC788\uB2E4. \uADF8\uB9AC\uACE0 \uC774\uB7EC\uD55C \uAC08\uB4F1\uC0C1\uD669\uC740 \uD574\uACB0\uC758 \uC2E4\uB9C8\uB9AC\uB97C \uCC3E\uC9C0 \uBABB\uD55C \uCC44 \uD604\uC7AC\uB3C4 \uC9C4\uD589 \uC911\uC774\uB2E4.",
