  "text" : "\uC791\uC6A9\uD558\uACE0 \uC788\uB2E4. \uADF8\uB3D9\uC548 \u2018\uB618\uB808\uB791\uC2A4\u2019\uB97C \uD45C\uBC29\uD558\uBA74\uC11C \uC774\uBBFC\uC790 \uC815\uCC45\uC758 \uC131\uACF5\uC801\uC778 \uC0AC\uB840\uB85C \uC190\uAF3D\uD788\uB358 \uD504\uB791\uC2A4\uC5D0\uC11C\uB3C4 2005\uB144 \uD30C\uB9AC \uC678\uACFD\uC758 \uC678\uAD6D\uC778\uC9D1\uB2E8\uAC70\uC8FC\uC9C0\uC5ED\uC778 \uBC29\uB9AC\uC720\uC5D0\uC11C \uC678\uAD6D\uC778\uC5D0 \uB300\uD55C \uCC28\uBCC4\uC5D0 \uC800\uD56D\uD558\uB294 \uB300\uADDC\uBAA8 \uC18C\uC694\uC0AC\uD0DC\uAC00 \uBC1C\uC0DD\uD558\uC600\uB2E4. \uC774 \uC0AC\uD0DC\uB294 \uD45C\uBA74\uC801\uC73C\uB85C \uC774\uBBFC\uC790\uC5D0 \uB300\uD55C",
