  "text" : "\uBBF8\uAD6D\uC758 \uACBD\uC6B0\uB294 \uC678\uAD6D\uC774\uBBFC\uC790\uB4E4\uACFC\uC758 \uAC08\uB4F1 \uC18D\uC5D0 \uAE30\uC874\uC758 \uC9C0\uBC30\uC9D1\uB2E8\uC774\uC5C8\uB358 \uBC31\uC778\uB4E4\uC774 \uB300\uAC70 \uB3C4\uC2DC \uC678\uACFD\uC73C\uB85C \uC774\uC804\uD558\uC600\uACE0, \uC774\uD6C4 \uC678\uAD6D\uC778 \uAC70\uC8FC\uC9C0\uC5ED\uC758 \uC0AC\uD68C\uD574\uCCB4, \uADF9\uBE48\uCE35 \uD751\uC778\uBC00\uC9D1\uC9C0\uC5ED\uC758 \uD615\uC131, \uB9CC\uC131\uC801 \uC6B0\uBC94\uC9C0\uB300\uD654\uC758 \uC21C\uC11C\uB97C \uBC1F\uC544 \uC624\uB298\uB0A0\uAE4C\uC9C0\uB3C4 \uBBF8\uAD6D\uC0AC\uD68C\uC758 \uC548\uC804\uC744 \uC704\uD611\uD558\uB294 \uBD88\uC548 \uC694\uC18C\uB85C",
