  "text" : "\uC5F0\uAD6C\uACB0\uACFC\uAC00 \uC788\uC74C. - McCord)\n\n\uC774\uBBF8 \uBC1C\uC0DD\uD55C \uBC94\uC8C4\uC5D0 \uD615\uB7C9\uB9CC \uB192\uC778\uB2E4\uB294 \uC2DD\uC758 \uC0AC\uD6C4\uC57D\uBC29\uBB38\uB9CC \uC368\uB308 \uAC83\uC774 \uC544\uB2C8\uB77C, \uC65C \uBC94\uC8C4\uAC00 \uBC1C\uC0DD\uD558\uB294\uC9C0\uB97C \uD30C\uC545\uD558\uACE0 \uC544\uB3D9\uD559\uB300\uCC98\uB7FC \uCC28\uD6C4 \uBC94\uC8C4\uBC1C\uC0DD\uC758 \uAC1C\uC5F0\uC131\uC774 \uB192\uC740 \uC694\uC778\uB4E4\uC744 \uC81C\uAC70\uD574\uB098\uAC00\uB294 \uAC83\uC774 \uC9C4\uC815\uD55C \uBC94\uC8C4 \uC5B5\uC81C\uC758 \uD55C \uBC29\uD3B8\uC774 \uB420 \uAC83.",
