  "text" : "\uC774\uB7EC\uD55C \uD6C4\uC720\uC99D\uC774 \uBC18\uC0AC\uD68C\uC801 \uC131\uACA9\uC73C\uB85C \uB098\uD0C0\uB098 \uAC01\uC885 \uBC94\uC8C4\uC758 \uAC00\uD574\uC790\uD654 \uB420 \uD655\uB960\uC774 \uB192\uAE30 \uB54C\uBB38. (\uC2E4\uC81C\uB85C \uCCAD\uC18C\uB144\uBC94\uC8C4\uC790 \uC911 \uC57D 80% \uC815\uB3C4\uAC00 \uC720\uAE30\uC640 \uD559\uB300\uB97C \uB2F9\uD55C \uACBD\uD5D8\uC774 \uC788\uACE0, \uC774\uCC98\uB7FC \uC720\uAE30\uC640 \uD559\uB300\uACBD\uD5D8\uC774 \uC788\uB294 \uC0AC\uB78C\uC758 \uC57D 50%\uAC00 \uBC94\uC8C4\uC790\uAC00 \uB418\uAC70\uB098 \uC54C\uCF5C\uC911\uB3C5\uC790\uAC00 \uB418\uC5C8\uB2E4\uB294",
