  "in_reply_to_user_id" : 95255804,
  "text" : "\uD2B9\uC815 \uBC95\uB960\uC758 \uC81C\uC815 \uBAA9\uC801\uC774\uB098 \uADF8 \uC874\uC7AC \uC790\uCCB4\uAC00 \uC704\uD5CC\uC801 \uC694\uC18C \uB4F1\uC758 \uBB38\uC81C\uB97C \uAC00\uC9C0\uACE0 \uC788\uC9C0 \uC54A\uB294 \uC774\uC0C1, \uD574\uB2F9 \uBC95\uB960 \uC804\uCCB4\uB97C \uC2F8\uC7A1\uC544 \uC545\uBC95\uC774\uB77C\uACE0 \uD558\uB294 \uAC83\uC740 \uBB34\uB9AC \uC544\uB2CC\uAC00.\n\n\uC544\uBB34\uB798\uB3C4 \uC544\uB3D9 \u00B7 \uCCAD\uC18C\uB144 \uB300\uC0C1 \uC131\uBC94\uC8C4\uC790\uB4E4\uC774 \uC544\uCCAD\uBC95 \uC804\uCCB4\uB97C \uC2F8\uC7A1\uC544 \uC545\uBC95\uC774\uB77C \uD560 \uD655\uB960\uC774 \uB192\uACA0\uC9C0..",
