  "in_reply_to_user_id" : 95255804,
  "text" : "\uC544\uC774\uB294 \uBD80\uBAA8\uC758 \uC601\uD5A5\uC744 \uBC1B\uAE30 \uB9C8\uB828\uC774\uAE30\uC5D0, \uC544\uC774 \uC55E\uC5D0\uC11C\uB294 \uB9D0\uACFC \uD589\uB3D9\uC744 \uC870\uC2EC\uD574\uC57C \uD55C\uB2E4. \uADF8\uB798\uC11C \uC544\uC774 \uC55E\uC5D0\uC11C \uBD80\uC790\uC5D0 \uB300\uD55C '\uB9F9\uBAA9\uC801'\uC778 \uC99D\uC624\uC640 \uC801\uAC1C\uC2EC\uC744 \uB4DC\uB7EC\uB0B4\uB294 \uAC83\uC740 \uC704\uD5D8\uD558\uB2E4\uACE0 \uD2B8\uC717\uC744 \uD588\uB354\uB2C8, \"\uADF8\uB807\uB2E4\uBA74 \uBD80\uB2F9\uD55C \uBD80 \uC55E\uC5D0\uC11C \uC808\uC774\uB77C\uB3C4 \uD558\uB780 \uB9D0\uC778\uAC00\"\uB780 \uBC18\uC751\uC774 \uC654\uB2E4.",
