  "text" : "\uC778\uC0DD\uC744 \uB3C8\uBC8C\uC774\uC5D0\uB9CC \uC9D1\uC911\uD558\uB294 \uAC83\uC740 \uC57C\uB9DD\uC758 \uBE48\uACE4\uC744 \uBCF4\uC5EC\uC8FC\uB294 \uAC83\uC774\uB2E4. \uB124 \uC2A4\uC2A4\uB85C\uC5D0\uAC8C \uB108\uBB34 \uC801\uC740 \uAC83\uC744 \uC694\uAD6C\uD558\uB294 \uAC83\uC774\uB2E4. \uC57C\uB9DD\uC744 \uAC00\uC9C0\uACE0 \uB354 \uD070 \uB73B\uC744 \uC774\uB8E8\uACE0\uC790 \uD560 \uB54C\uC5D0\uC57C \uBE44\uB85C\uC18C \uC9C4\uC815\uD55C \uC790\uC2E0\uC758 \uC7A0\uC7AC\uB825\uC744 \uC2E4\uD604\uD560 \uC218 \uC788\uAE30 \uB54C\uBB38\uC774\uB2E4.\n\n- \uBC84\uB77D \uC624\uBC14\uB9C8",
