  "text" : "\uB3D9\uC131\uC560\uB97C \uC7AC\uC0DD\uC0B0 \uBC30\uC81C\uC758 \uAD00\uC810\uC5D0\uC11C \uBCF8 \uAC83\uC774 \uB098\uCE58\uAC00 \uCC98\uC74C\uC740 \uC544\uB2C8\uC9C0\uB9CC, \uBB50 '\uC790\uC5F0\uC758 \uC12D\uB9AC\uC5D0 \uBC18\uD55C\uB2E4' \uC758 \uC785\uC7A5\uC744 \uB6F0\uC5B4\uB118\uC5B4 '\uC131\uAD00\uACC4\uB294 \uC544\uC774\uB97C \uC0DD\uC0B0\uD574\uC57C\uB9CC \uD558\uB294\uB370, \uB3D9\uC131\uC560\uB294 \uC774\uAC78 \uBABB\uD558\uBBC0\uB85C \uC8C4\uC545'\uC774\uB77C\uBA70 \uBA85\uBB38\uBC94\uC8C4\uD654 \uC2DC\uCF30\uB2E4\uB294 \uC810\uC5D0\uC11C \uB098\uCE58\uAC00 \uD2B9\uBCC4\uD55C \uAC83\uC774 \uC544\uB2D0\uAE4C \uC2F6\uC740\uB370..",
