  "text" : "\uBC94\uC8C4\uC758 \uC6D0\uC778\uC774\uB780\uAC8C \uC815\uB9D0 \uBCF5\uD569\uC801\uC774\uACE0, \uD55C\uAC00\uC9C0 \uC694\uC778\uB9CC \uB531 \uACE8\uB77C\uC11C \uC9C0\uBAA9\uD560 \uC218\uB3C4 \uC5C6\uB294 \uAC83\uC774\uAE30\uC5D0 \uC544\uC9C1\uB3C4 \uC5F0\uAD6C\uAC00 \uD65C\uBC1C\uD558\uAC8C \uC774\uB8E8\uC5B4\uC9C0\uACE0 \uC788\uB294 \uBD84\uC57C\uC785\uB2C8\uB2E4. \uD558\uC9C0\uB9CC \uC774\uAC74 \uC81C\uAC00 \uC7A5\uB2F4\uD560 \uC218 \uC788\uC5B4\uC694. \uB9CE\uC740 \uD749\uC545\uBC94\uC8C4\uC790\uB4E4\uC774 \uC131\uC7A5\uAE30\uC5D0 \uBCF4\uD638\uC790\uB85C\uBD80\uD130 \uC65C\uACE1\uB41C \uAC00\uCE58\uAD00\uC774 \uC8FC\uC785\uB418\uC5C8\uB2E4\uB294 \uAC83.",
