  "text" : "\uC8FC\uC7A5\uD558\uBA74\uC11C \uC5C6\uB294 \uC0AC\uB78C\uB4E4\uACFC \uB69C\uB837\uD558\uAC8C \uAD6C\uBCC4\uC9D3\uB294 \uADF8\uB4E4\uC740 \uC5B4\uB560\uB294\uB370? \uC790\uAE30\uB4E4\uC774 \uC18D\uD55C \uADF8 \uBD80(\u5BCC)\uC758 \uC9D1\uB2E8\uC740 \uD56D\uC0C1 \uC633\uAC70\uB098 \uC815\uC0C1\uC774\uACE0 \uC5C6\uB294 \uC790\uB4E4\uC758 \uC9D1\uB2E8\uC740 \uD56D\uC0C1 \uADF8\uB974\uBA70 \uBE44\uC815\uC0C1\uC774\uB77C \uC8FC\uC7A5\uD558\uB294 \uADF8\uB4E4\uC740, \uB208\uBE5B\uB9C8\uC800 \uADF8\uB7F0 \uB208\uCD08\uB9AC\uB85C \uBCF4\uB294 \uC9C4\uC815 \uADF8\uB4E4\uC740 \uC5B4\uB560\uB294\uB370?\u201D]",
