  "text" : "\uB098\uC911\uC5D0 \uC2DC\uAC04\uC774 \uB418\uC2E4 \uB54C '\uAE09\uC9C4\uBC94\uC8C4\uD559, \uAE09\uC9C4\uBC94\uC8C4\uB860, \uB9C8\uB974\uD06C\uC2A4\uC8FC\uC758 \uBC94\uC8C4\uD559' \uB4F1\uC744 \uCC3E\uC544\uBCF4\uC2E0\uB2E4\uBA74 \uC81C\uAC00 \uD558\uB294 \"\uB9CE\uC740 \uD749\uC545\uBC94\uC8C4\uC790\uB4E4\uC774 \uC65C\uACE1\uB41C \uC0AC\uD68C\uC778\uC2DD\uC5D0 \uAE30\uBC18\uD558\uC5EC \uC790\uC2E0\uC758 \uBC94\uD589\uC744 \uC758\uC801\uD654\uD558\uACE0 \uD569\uB9AC\uD654 \uD558\uACE0 \uC788\uB2E4\"\uB294 \uB9D0\uC744 \uC774\uD574\uD558\uC2DC\uB294\uB370 \uD070 \uB3C4\uC6C0\uC774 \uB420 \uAC83\uC774\uB77C \uC0DD\uAC01\uD569\uB2C8\uB2E4.",
