  "text" : "\uB9CE\uC740 \uBC94\uC8C4\uD559\uC790\uB4E4\uC774 \uD749\uC545\uBC94\uC8C4\uC758 \uC6D0\uC778\uC744 \uBC94\uC8C4\uC790\uC758 \uBD80\uBAA8\uB098 \uADF8 \uBCF4\uD638\uC790 \uBC0F \uADF8\uB7EC\uD55C \uC131\uC7A5\uACFC\uC815\uC5D0\uC11C \uCC3E\uACE0 \uC788\uC2B5\uB2C8\uB2E4. \uC544\uB3D9\uAE30\uC758 \uC0AC\uD68C\uD654\uACFC\uC815\uC5D0\uC11C \uD2B9\uC815 \uACC4\uCE35 \uB4F1\uC5D0 \uB300\uD55C \uC798\uBABB\uB41C \uAC00\uCE58\uAD00\uC5D0 \uC9C0\uC18D\uC801\uC73C\uB85C \uB178\uCD9C\uB418\uB2E4\uBCF4\uBA74 \uC774\uAC83\uC774 \uC790\uAE30\uD1B5\uC81C\uB825\uC758 \uC57D\uD654\uB098 \uC0C1\uC2E4\uB85C \uC774\uC5B4\uC9C4\uB2E4\uB294 \uAC83\uC774\uC8E0.",
