  "text" : "\uC0C1\uB2F9\uC218 \uD749\uC545\uBC94\uC8C4\uC790\uB4E4\uC758 \uBC94\uC8C4\uC758 \uC6D0\uB3D9\uB825\uC774 '\uAC00\uC9C4 \uC790\uB4E4\uC5D0 \uB300\uD55C \uC774\uC720 \uC5C6\uB294 \uC99D\uC624' \uBC0F '\uC0AC\uD68C\uC5D0 \uB300\uD55C \uC65C\uACE1\uB41C \uBC18\uD56D'\uC785\uB2C8\uB2E4. \uC774\uB4E4\uC740 \uC800\uB7EC\uD55C \uAC00\uCE58\uAD00\uC744 \uBC14\uD0D5\uC73C\uB85C \uC790\uC2E0\uC758 \uD589\uB3D9\uC744 \uC815\uB2F9\uD654\uD558\uACE0, \uC2EC\uC9C0\uC5B4\uB294 \uC790\uC2E0\uC744 \uD64D\uAE38\uB3D9\uC774\uB098 \uC784\uAEBD\uC815\uACFC \uAC19\uC740 \uC758\uC801\uACFC \uB3D9\uC77C\uC2DC\uD558\uB294 \uACBD\uD5A5\uAE4C\uC9C0 \uC788\uC2B5\uB2C8\uB2E4.",
