  "text" : "\uC5EC\uD2BC, \uC9C0\uD558\uCCA0 \uD22C\uC2E0\uC790\uC0B4\uC0AC\uAC74\uC73C\uB85C \uC778\uD574 \uC5B4\uC81C \uC800\uB141\uC5D0 \uC11C\uC6B8\uC2DC\uB0B4 \uC9C0\uD558\uCCA0 1\uD638\uC120 \uC778\uCC9C\uBC29\uBA74\uD589\uC758 \uC6B4\uD589\uC774 \uC804\uBA74 \uC911\uB2E8\uB418\uC5C8\uB358 \uD0D3\uC5D0 \uACF5\uACF5\uC7A5\uC18C\uC5D0\uC11C\uC758 \uC790\uC0B4\uC5D0 \uB300\uD55C \uB9D0\uB4E4\uC774 \uC774\uB798\uC800\uB798 \uB9CE\uC740 \uC0C1\uD0DC\uC778\uB370..\n\n\uB098\uB294 \uBB50\uB77C \uB9D0\uC744 \uBABB\uD558\uACA0\uB2E4. \uC591\uCABD \uC758\uACAC\uC774 \uB2E4 \uB9DE\uB294 \uC18C\uB9AC\uC778 \uAC83\uC774 \uC0AC\uC2E4\uC778\uC9C0\uB77C..",
