  "text" : "\uD589\uC704\uB294 \uD615\uBC95\uC774 \uC2B9\uC778\uD558\uAE30 \uD798\uB4E0 \uC790\uC720\uC758 \uB0A8\uC6A9\uC774\uB2E4. \uADF8\uB7EC\uB098 \uD604\uC2E4\uC801\uC73C\uB85C \uCC98\uBC8C\uC774 \uBD88\uAC00\uB2A5\uD558\uAE30 \uB54C\uBB38\uC5D0 \uC5B4\uCA54 \uC218 \uC5C6\uC774 \uCC98\uBC8C\uD558\uC9C0 \uC54A\uC744 \uBFD0\uC774\uB2E4. \uC774\uB807\uAC8C \uC774\uD574\uD574\uC57C \uD615\uBC95\uC758 \uC0DD\uBA85\uC874\uC911\uC0AC\uC0C1\uC740 \uBCF4\uD3B8\uC131\uC744 \uAC00\uC9C8 \uC218 \uC788\uB2E4.\"\n\n- \uBC30\uC885\uB300 (\uAD50\uC218, \uACE0\uB824\uB300\uD559\uAD50 \uBC95\uD559\uC804\uBB38\uB300\uD559\uC6D0)",
