  "text" : "\uBC1B\uC544\uB4E4\uC774\uC9C0 \uC54A\uACE0 \uB610 \uADF8\uB7F4 \uC218 \uC5C6\uB2E4\uBA74 \uC774 \uC774\uB860\uAD6C\uC131\uC740 \uD604\uC2E4\uC744 \uBB34\uC2DC\uD55C \uAD00\uB150\uC801\uC778 \uAC83\uC73C\uB85C \uBE44\uD310\uBC1B\uC544\uC57C \uD55C\uB2E4. \uD615\uBC95\uC740 \uC790\uC0B4\uC744 '\uB2F9\uC5F0\uD788' \uCC98\uBC8C\uD558\uC9C0 \uC54A\uB294 \uAC83\uC774 \uC544\uB2C8\uBA70 \uC0DD\uAC01 \uAC19\uC544\uC11C\uB294 \uCC98\uBC8C\uD558\uACE0 \uC2F6\uC740 \uB9C8\uC74C\uC774 \uAC04\uC808\uD558\uB2E4. \uD0C0\uC778\uC758 \uC0DD\uBA85\uC874\uC911\uC758 \uC804\uC81C\uAC00 \uB418\uB294 \uC790\uAE30\uC758 \uC0DD\uBA85\uC874\uC911\uC744 \uBB34\uC2DC\uD55C",
