  "text" : "\uB530\uB77C\uC11C \uC790\uAE30 \uC0DD\uBA85\uC744 \uC2A4\uC2A4\uB85C \uD3EC\uAE30\uD558\uB294 \uD589\uC704\uB294 \uC0AC\uD68C\uC801 \uBE44\uB09C\uC758 \uB300\uC0C1\uC774 \uB418\uBA70 \uACB0\uCF54 \uC0AC\uD68C\uC801\uC73C\uB85C \uBB34\uC758\uBBF8\uD55C \uD589\uC704\uC5D0 \uC18D\uD558\uC9C0\uB294 \uC54A\uB294\uB2E4. \uADF8\uB7EC\uBBC0\uB85C \uC790\uC0B4\uC744 \uCC98\uBC8C\uD558\uC9C0 \uC54A\uB294 \uADFC\uAC70\uB97C \uD53C\uD574\uC790\uC758 \uC790\uC720\uB85C\uC6B4 \uC758\uC0AC\uACB0\uC815\uC5D0 \uC758\uD55C \uD3EC\uAE30(\uC81C24\uC870 \uD53C\uD574\uC790\uC2B9\uB099 \uC774\uB860)\uC5D0\uC11C \uCC3E\uB294 \uAC83\uC740 \uC9C0\uB098\uCE58\uAC8C",
