  "text" : "\uC54A\uC740 \uC774\uC720\uB294 \uCC98\uBC8C\uB300\uC0C1\uACFC \uCC98\uBC8C\uC774\uC775\uC774 \uC5C6\uAE30 \uB54C\uBB38\uC774\uB2E4. \uC790\uAE30\uC758 \uC0DD\uBA85, \uD0C0\uC778\uC758 \uC0DD\uBA85\uC744 \uBD88\uBB38\uD558\uACE0 \uC0DD\uBA85\uC740 \uC5B4\uB5A4 \uACBD\uC6B0\uC5D0\uB3C4 \uC874\uC911\uB418\uC5B4\uC57C \uD558\uACE0 \uB610 \uC874\uC911\uD574\uC57C \uD560 \uC758\uBB34\uAC00 \uC788\uB2E4. \uC774\uAC83\uC740 \uD615\uBC95 \uC774\uC804\uC758 \uBB38\uC81C\uB85C\uC11C \uC6B0\uB9AC \uC0AC\uD68C\uC758 \uBCF4\uD3B8\uC801\uC73C\uB85C \uC2B9\uC778\uB41C \uADDC\uBC94\uC5D0 \uC18D\uD55C\uB2E4\uACE0 \uD560 \uC218 \uC788\uB2E4.",
