  "text" : "\uC6B0\uB9AC \uD615\uBC95\uC774 \uC790\uC0B4\uC790\uB97C \uCC98\uBC8C\uD558\uC9C0 \uC54A\uB294 \uAC83\uC5D0 \uB300\uD574\uC11C\uB294 \uB2E4\uC74C\uACFC \uAC19\uC740 \uACAC\uD574\uB3C4 \uC874\uC7AC\uD569\uB2C8\uB2E4.\n\"\uC790\uC0B4\uC774 \uCC98\uBC8C\uB418\uC9C0 \uC54A\uB294 \uD615\uC2DD\uC801 \uADFC\uAC70\uB294 \uD615\uBC95\uC774 \uC774\uC5D0 \uB300\uD55C \uCC98\uBC8C\uADDC\uC815\uC744 \uB450\uACE0 \uC788\uC9C0 \uC54A\uAE30 \uB54C\uBB38\uC774\uB2E4. \uC989 \uC790\uC0B4\uC740 \uAD6C\uC131\uC694\uAC74\uD574\uB2F9\uC131\uC774 \uC5C6\uB2E4. \uADF8\uB9AC\uACE0 \uD615\uBC95\uC774 (\uC790\uC0B4\uC790\uC758)\uCC98\uBC8C\uADDC\uC815\uC744 \uB450\uC9C0",
