  "text" : "\uB9D0\uC500\uD558\uC2DC\uB294\uAC74 \uC544\uBB34\uB798\uB3C4 '\uC758\uC0AC\uC870\uB825\uC790\uC0B4(\uD658\uC790 \uC2A4\uC2A4\uB85C\uAC00 \uC0DD\uBA85\uC744 \uB04A\uACE0, \uC758\uC0AC\uB294 \uC774\uB97C \uB3C4\uC640\uC8FC\uB294 \uAC83)' \uAC19\uC740\uB370.. \uC874\uC5C4\uC0AC\uB294 \uB2E8\uC21C\uD788 '\uC790\uC0B4\uC744 \uC6A9\uC774\uD558\uAC8C \uD560 \uAD8C\uB9AC'\uAC00 \uC544\uB2C8\uACE0, \uD68C\uBCF5\uBD88\uAC00\uB2A5\uD55C \uC0C1\uD0DC\uC5D0 \uC788\uB294 \uC911\uD658\uC790\uAC00 \uC880 \uB354 \uD488\uC704\uC788\uACE0 \uD3B8\uC548\uD558\uAC8C \uC8FD\uC74C\uC744 \uB9DE\uC774\uD560 \uAD8C\uB9AC\uB85C \uC5F0\uACB0\uB429\uB2C8\uB2E4.",
