  "text" : "\uACBD\uCC30\uC758 \uD604\uC7A5\uAC80\uC99D\uC73C\uB85C \uC804\uCCA0 \uC7AC\uC6B4\uC601\uC5D0\uAE4C\uC9C0 \uC2DC\uAC04\uC774 \uB9CE\uC774 \uAC78\uB9AC\uAE30 \uB54C\uBB38\uC774\uB2E4. \uD2B9\uD788\uB098 \uC2E0\uCE78\uC13C\uC758 \uACBD\uC6B0\uC5D4 \uC2B9\uAC1D\uB4E4\uC5D0\uAC8C \uD0DD\uC2DC\uBE44\uC6A9\uC744 \uC8FC\uB294 \uB4F1 \uAD50\uD1B5 \uB300\uCC45\uC774 \uD544\uC694\uD574 \uC790\uC0B4\uC790\uC758 \uC720\uC871\uB4E4\uC5D0\uAC8C 1\uC5B54000\uB9CC \uC5D4\uC758 \uC190\uD574\uBC30\uC0C1\uC774 \uCCAD\uAD6C\uB41C \uC608\uB3C4 \uC788\uB2E4.",
