  "text" : "(\uC880 \uB9CE\uC774 \uACFC\uC7A5\uB41C \uC608\uC774\uAE30\uB294 \uD55C\uB370) \uB9CC\uC57D \uADF8 \uB3D9\uC601\uC0C1\uC774 \uD3C9\uBC94\uD55C \uCD08\uB4F1\uD559\uC0DD\uC774 \uAD8C\uD22C\uC120\uC218 \uB9C8\uC774\uD06C \uD0C0\uC774\uC2A8\uC5D0\uAC8C \uD5DB\uC8FC\uBA39\uC9C8\uC744 \uD588\uACE0, \uD0C0\uC774\uC2A8\uC774 \uD575\uC774\u3143.. \uC544\uB2C8, \uD575\uC8FC\uBA39\uC73C\uB85C \uCD08\uB4F1\uD559\uC0DD\uC5D0\uAC8C \uBC18\uACA9\uC744 \uAC00\uD574 \uC4F0\uB7EC\uB728\uB9AC\uB294 \uB3D9\uC601\uC0C1\uC774\uC5C8\uB2E4\uBA74, \uADF8 \uBC11\uC5D0 \uB2EC\uB9B0 \uB313\uAE00\uB4E4\uC740 \uC9C0\uAE08\uACFC\uB294 \uC815\uBC18\uB300\uC600\uACA0\uC9C0..",
