  "text" : "\uD574\uB2F9 \uB0A8\uC131\uC740 \uC5EC\uC131\uC5D0\uAC8C \uB9DE\uC740 \uAC83 \uAC19\uC9C0\uB3C4 \uC54A\uC558\uACE0, \uC124\uC0AC \uB9DE\uC558\uB2E4 \uCE58\uB354\uB77C\uB3C4 \uAC70\uC758 \uD0C0\uACA9\uC774 \uC5C6\uC5B4\uBCF4\uC774\uB294 \uC218\uC900\uC758 \uACF5\uACA9 \uAC19\uB358\uB370, \uADF8\uB7EC\uD55C \uACBD\uBBF8\uD55C \uACF5\uACA9\uC5D0 \uB300\uD574 \uC720\uB9AC\uCC3D\uC774 \uBC15\uC0B4\uB0A0 \uC815\uB3C4\uC758 \uBC18\uACA9\uD589\uC704\uB97C \uD55C \uAC83\uC5D0 \uB300\uD574\uC11C\uB3C4 \uC815\uB2F9\uBC29\uC704\uB97C \uC778\uC815\uD574\uC57C \uD560\uC9C0\uB294 \uC758\uBB38\uC2A4\uB7EC\uC6B8 \uBFD0\uC774\uB2E4.",
