  "text" : "\uC77C\uB2E8 \uD574\uB2F9 \uC5EC\uC131\uC740 \uB0A8\uC131\uC758 \uC5BC\uAD74\uC744 \uD5A5\uD574 \uC8FC\uBA39\uC9C8\uC744 \uD558\uC600\uC73C\uB098 \uC5BC\uAD74\uC5D0 \uBBF8\uCE58\uC9C0 \uBABB\uD558\uACE0 \uD5DB\uC190\uC9C8\uC5D0 \uADF8\uCE5C \uAC83 \uAC19\uACE0, \uC77C\uB2E8 \uB3D9\uC601\uC0C1\uC5D0 \uB098\uC624\uB294 \uB0A8\uB140\uC758 \uCCB4\uAE09\uCC28\uAC00 (\uC880 \uACFC\uC7A5\uD558\uC790\uBA74) \uB450\uBC30\uB294 \uB418\uC5B4\uBCF4\uC774\uB358\uB370.. \uCE68\uD574\uC758 \uD604\uC7AC\uC131 \uC774\uB7F0\uAC74 \uB458\uC9F8\uCE58\uACE0, \uACFC\uC5F0 \uADF8 \uBC18\uACA9\uD589\uC704\uAC00 \uD544\uC694\uD588\uC5C8\uB098 \uC2F6\uB2E4.",
