  "text" : "\uC6B8\uBA74\uC11C \uCC3E\uB294 \uC790\uC2E0\uC744 \uB0A8\uD3B8\uC774 \uD790\uB09C\uD588\uB294\uB370, \uC54C\uACE0 \uBCF4\uB2C8 \uB0A8\uD3B8\uC774 \uC9C0\uAC11\uC744 \uD6D4\uCCD0\uAC04 \uAC83. \uC0AC\uAC74 \uBC1C\uC0DD \uBA70\uCE60 \uC804\uC5D0 \uBC1C\uC0DD\uD55C \uC774 \uC0AC\uAC74\uC73C\uB85C \uC790\uC81C\uB825\uC744 \uC783\uC5B4\uBC84\uB9B0 \uC0C1\uD0DC\uC600\uB358\uB4EF\uD568. \uC0AC\uAC74\uB2F9\uC2DC \uB0A8\uD3B8\uACFC \uAC19\uC774 \uC220\uC744 \uB9C8\uC2DC\uBA74\uC11C \uD3ED\uD589\uC744 \uB2F9\uD558\uB2E4\uAC00, \uC220\uC5D0 \uCDE8\uD574 \uB0A8\uD3B8\uC774 \uC7A0\uB4E0 \uC0AC\uC774\uC5D0 \uC0B4\uD574. \uC9D5\uC5ED 7\uB144",
