  "text" : "\uD63C\uC790\uC11C \uC138\uC0C1\uC744 \uC0B4\uC544\uAC00\uB294\uB370 \uB450\uB824\uC6C0\uC744 \uB290\uAF08\uB2E4\uACE0 \uD568. \uC544\uBC84\uC9C0\uB85C\uBD80\uD130 \uD3ED\uB825\uC744 \uB2F9\uD574\uC654\uB358 \uCE5C\uC815\uC5B4\uBA38\uB2C8\uB3C4 \uC774\uB7EC\uD55C \uC0AC\uC2E4\uC744 \uC54C\uBA74\uC11C \uC544\uBB34\uB7F0 \uB3C4\uC6C0\uC744 \uC8FC\uC9C0 \uC54A\uC558\uC74C. \uB0A8\uD3B8\uC774 \uC790\uC2E0\uC744 \uB54C\uB824 \uC774\uAC00 \uAE68\uC838\uC11C, \uC0C8 \uC774\uB97C \uD574 \uB123\uC744 \uB3C8\uC744 \uB0A8\uD3B8\uC774 \uC8FC\uC5C8\uB294\uB370, \uC774\uB97C \uC9C0\uAC11\uC5D0 \uAC00\uC9C0\uACE0 \uC788\uB2E4\uAC00 \uC783\uC5B4\uBC84\uB9BC.",
