  "text" : "&lt;\uD559\uB300\uD558\uB358 \uB0A8\uD3B8\uC744 \uC0B4\uD574\uD55C \uC5EC\uC131 \uC0C1\uB2F4\uC0AC\uB840 \uB610 \uD558\uB098&gt;\n\n\uACB0\uD63C\uC0DD\uD65C 2\uB144. \uAE30\uB85D\uC0C1 \uACFC\uAC70\uC5D0 \uC5B8\uB2C8\uC640 \uB354\uBD88\uC5B4 \uC544\uBC84\uC9C0\uB85C\uBD80\uD130 \uC131\uD3ED\uD589\uC744 \uB2F9\uD55C \uAC83\uC73C\uB85C \uB098\uC640 \uC788\uC74C. \uD3C9\uC18C\uC5D0\uB294 2~3\uC77C\uC5D0\uD55C \uBC88\uC529 \uD3ED\uD589\uC744 \uB2F9\uD588\uB2E4\uACE0 \uC751\uB2F5. \uB0A8\uD3B8\uC758 \uC758\uCC98\uC99D\uACFC \uD3ED\uD589\uC774 \uC2EC\uAC01\uD588\uC73C\uB098 \uB0A8\uD3B8\uC774 \uBD88\uC30D\uD558\uACE0",
