  "text" : "\uC5B4\uB514 \uAC00\uB0D0\uACE0 \uB0A8\uD3B8\uC774 \uBB50\uB77C\uACE0 \uD574\uC11C \uC77C\uB2E8 \uBAA8\uD154\uC5D0 \uB4E4\uC5B4\uAC10. \uBAA8\uD154\uC5D0\uC11C\uB3C4 \uACC4\uC18D \uB0B4\uC5F0\uB140\uC5D0\uAC8C \uC804\uD654\uD558\uB77C\uACE0 \uD558\uACE0, \uBCF8\uC778\uC740 \uACC4\uC18D \uD63C\uC790 \uC8FD\uC744 \uC0DD\uAC01\uB9CC \uD588\uC74C. \uADF8\uB7F0\uB370 \uB0A8\uD3B8 \uB450\uACE0 \uC8FD\uC790\uB2C8 \uC598\uB4E4\uC774\uB791 \uC2DC\uC5B4\uBA38\uB2C8\uAC00 \uAC71\uC815\uB418\uC5B4 \uAC19\uC774 \uC8FD\uC5B4\uC57C \uACA0\uB2E4\uACE0 \uC0DD\uAC01. \uBC14\uC9C0 \uD5C8\uB9AC\uB760\uB85C \uB0A8\uD3B8 \uBAA9 \uC878\uB77C \uC8FD\uC784.",
