  "text" : "\uADF8 \uC640\uC911\uC5D0 \uC220 \uAC12 \uB0B4\uB2EC\uB77C\uBA70 \uC885\uC885 \uC5F0\uB77D\uD568. \uC0AC\uAC74 \uB2F9\uC77C, \uC220 \uAC12 \uB0B4\uB2EC\uB77C\uACE0 \uB610 \uC5F0\uB77D\uD574\uC11C \uB098\uC654\uB294\uB370 \uACC4\uC18D \uC220 \uC548 \uAE6C \uC0C1\uD0DC\uB85C \uC220 \uBA39\uC73C\uB7EC \uB2E4\uB2C8\uB2E4\uAC00 \uADF8 \uB0B4\uC5F0\uB140\uC758 \uC0AC\uBB34\uC2E4\uB85C \uCC3E\uC544\uAC10. \uADF8 \uC55E\uC5D0\uC11C \uBCF8\uC778\uC744 \uBAA8\uC695. \uC0AC\uAC74 \uB2F9\uC77C\uC5D0 \uD568\uAED8 \uC8FD\uC744 \uC0DD\uAC01\uC73C\uB85C \uCC28\uB97C \uBAB0\uACE0 \uAC00\uB294\uB370",
