  "text" : "\uB0A8\uD3B8\uC774 \uC220\uC744 \uBA39\uACE0 \uB4E4\uC5B4\uC624\uBA74 \uC804\uD600 \uC81C\uC5B4\uAC00 \uB418\uC9C0 \uC54A\uC558\uACE0 \uBB34\uC870\uAC74 \uD53C\uD574\uC57C \uD568. \uC5EC\uC790 \uBB38\uC81C\uB3C4 \uC788\uC5B4\uC11C \uC774\uB7F0 \uBB38\uC81C\uB85C \uBCF8\uC778(\uAC00\uD574\uC5EC\uC131)\uC774 \uC0C1\uB2F4\uB3C4 \uBC1B\uC74C. \uC790\uC0B4 \uC0DD\uAC01 \uB9CE\uC774 \uD588\uC5C8\uACE0, \uC0AC\uAC74 \uBC1C\uC0DD 1\uB2EC \uC804\uBD80\uD130 \uB610 \uC220\uC744 \uBA39\uAE30 \uC2DC\uC791, \uAC70\uC758 1\uB2EC \uC815\uB3C4 \uC9D1\uC5D0 \uB4E4\uC5B4\uC624\uC9C0 \uC54A\uC74C.",
