  "text" : "(\uC18C\uC124 \uBB35\uD5A5\uC5D0\uC11C \uBB35\uD5A5\uC774 \uC774\uC138\uACC4\uB85C \uAC14\uC744 \uB54C '\uB2E4\uD06C \uD3F0 \uCE58\uB808\uC544 \uB300\uACF5'\uC758 \uC2E0\uBD84\uC73C\uB85C \uB2E4\uC2A4\uB9AC\uAC8C \uB418\uB294 \uCE58\uB808\uC544\uAC00 \uBC14\uB85C (\uB300)\uACF5\uAD6D\uC785\uB2C8\uB2E4. \uD06C\uB77C\uB808\uC2A4 \uC81C\uAD6D\uC5D0 \uC18D\uD558\uACE0 \uD06C\uB77C\uB808\uC2A4 \uD669\uC81C\uC5D0\uAC8C \uCDA9\uC131\uC744 \uBC14\uCE58\uC9C0\uB9CC, \uACF5\uC791(or \uB300\uACF5)\uC774 \uC9C0\uBC30\uD558\uACE0 \uC788\uC73C\uBA70 \uC790\uCE58\uAD8C\uC744 \uC778\uC815\uBC1B\uB294 '\uAD6D\uAC00'\uC774\uC8E0.)",
