  "text" : "\uACF5\uC791 \uC815\uB3C4\uBA74 \uC0AC\uC2E4\uC0C1 \uC655\uC5D0 \uAC00\uAE5D\uC2B5\uB2C8\uB2E4. \uC655\uBCF4\uB2E4\uB294 \uB0AE\uC9C0\uB9CC, \uC624\uB4F1\uC791 \uCD5C\uC0C1\uC704\uC5D0 \uC704\uCE58\uD55C \uADC0\uC871\uC73C\uB85C\uC11C \uC77C\uAD6D\uC744 \uD1B5\uCE58 \uD560 \uC218 \uC788\uC73C\uB2C8\uAE4C\uC694. \uC6B0\uB9AC\uAC00 \uD754\uD788 \uC54C\uACE0 \uC788\uB294 \uBAA8\uB098\uCF54\uB098 \uB8E9\uC148\uBD80\uB974\uD06C \uB4F1\uC774 \uBC14\uB85C \uACF5\uC791\uC774 \uD1B5\uCE58\uD558\uB294 '\uACF5\uAD6D'\uC785\uB2C8\uB2E4. \uC655\uAD6D\uC774 \uC544\uB2C8\uAE30\uC5D0 \uAD70\uC8FC\uB3C4 '~\uACF5'\uC73C\uB85C \uBD88\uB9AC\uC8E0.",
