  "text" : "\uD574\uB2F9 \uC758\uC6D0\uC758 \uBC1C\uC5B8\uC5D0 \uC194\uC9C1\uD788 \uC5F4\uC774 \uBC1B\uC744\uB300\uB85C \uBC1B\uC558\uB294\uB370, \uC774 \uBD84\uC5D0\uAC8C '\uBD88\uC774\uC775'\uC774\uB780 \uAC83\uC744 \uC904 \uC218 \uC788\uB294 \uBC29\uBC95\uC774 \uC5C6\uC5B4 \uB354\uB354\uC6B1 \uD654\uAC00 \uB09C\uB2E4. \uAD6D\uD68C\uC758\uC6D0\uC758 \uC9D5\uACC4\uC0AC\uC720\uC5D0 '\uD5CC\uBC95\uC5D0 \uADDC\uC815\uB41C \uAD6D\uBBFC\uC758 \uAE30\uBCF8\uAD8C\uC744 \uBB34\uC2DC\uD558\uB294 \uB9C9\uB9D0\uC744 \uD588\uC744 \uB54C'\uB3C4 \uB123\uC5B4\uB2EC\uB77C\uB294 \uC5B5\uC9C0\uB77C\uB3C4 \uBD80\uB9AC\uACE0 \uC2F6\uC740 \uC2EC\uC815\uC774\uB2E4.",
