  "text" : "\uC77C\uBC18 \uB300\uC911\uC740 \uC218\uB3D9\uC801\uC778 \uC704\uCE58\uC5D0 \uBA38\uBB34\uB974\uB294 \uAC83\uC774\uB2E4. \uC9D1\uD68C\uC758 \uC790\uC720\uB294 \uC774\uB7EC\uD55C \uC218\uB3D9\uC801\uC778 \uC704\uCE58\uB97C \uB2A5\uB3D9\uC801\uC778 \uC704\uCE58\uB85C \uCE58\uD658\uD560 \uC218 \uC788\uB294 \uAE30\uBCF8\uAD8C\uC774\uB2E4. \uC774\uB7EC\uD55C \uC758\uBBF8\uC5D0\uC11C \uC9D1\uD68C\uC758 \uC790\uC720\uB294 \uC0AC\uD68C\uC801 \uC57D\uC790\uAC00 \uAE30\uB308 \uC218 \uC788\uB294 \uC57D\uC790\uC758 \uAE30\uBCF8\uAD8C\uC774\uB2E4. ]\n\n- \uC815\uD544\uC6B4, \uD5C8\uC601, \uC774\uC2B9\uC6B0, \uC591\uAC74 \uB4F1",
