  "text" : "\uD2B9\uD788 \uC81C\uB3C4\uC801\uC73C\uB85C \uAD6C\uD604\uB418\uC5B4 \uC788\uB294 \uC5B8\uB860\uC774 \uAD6D\uAC00\uAD8C\uB825\uC5D0 \uB0A0 \uC120 \uBE44\uD310\uC744 \uD558\uC9C0 \uBABB\uD558\uB294 \uB54C, \uC9D1\uD68C\uC758 \uC790\uC720\uB294 \uC774\uB97C \uBCF4\uC644\uD558\uB294 \uAE30\uB2A5\uC744 \uC218\uD589\uD55C\uB2E4. \uD604\uB300 \uC5B8\uB860\uC758 \uAC00\uC7A5 \uD070 \uD2B9\uC131 \uC911 \uD558\uB098\uC778 \uBCF4\uB0B4\uB294 \uC0AC\uB78C\uACFC \uBC1B\uB294 \uC0AC\uB78C, \uB9D0\uD558\uB294 \uC0AC\uB78C\uACFC \uB4E3\uB294 \uC0AC\uB78C, \uC4F0\uB294 \uC0AC\uB78C\uACFC \uC77D\uB294 \uC0AC\uB78C\uC774 \uBD84\uB9AC\uB418\uC5B4",
