  "text" : "\uC774 \uB54C \uC9D1\uD68C\uC758 \uC790\uC720\uB294 \uAD6D\uAC00\uC758\uC0AC \uD615\uC131\uACFC\uC815\uC5D0 \uAD6D\uBBFC \uAC01\uC790 \uB610\uB294 \uC9D1\uB2E8\uC758 \uAD6C\uCCB4\uC801\uC778 \uC758\uC0AC\uB97C \uD22C\uC785\uD558\uB294 \uACC4\uAE30\uB97C \uBCF4\uC7A5\uD55C\uB2E4. \uC774\uB85C\uC368 \uCD94\uC815\uC801 \uAD6D\uBBFC\uC758\uC0AC\uC640 \uAD6C\uCCB4\uC801 \uAD6D\uBBFC\uC758\uC0AC\uAC00 \uC2EC\uAC01\uD558\uAC8C \uAD34\uB9AC\uB418\uB294 \uD604\uC0C1\uC744 \uBC29\uC9C0\uD560 \uC218 \uC788\uB2E4. \uC774\uB7EC\uD55C \uC758\uBBF8\uC5D0\uC11C \uC9D1\uD68C\uC758 \uC790\uC720\uB294 \uC18C\uC218\uBCF4\uD638\uC758 \uAE30\uB2A5\uC744 \uC218\uD589\uD55C\uB2E4.",
