  "text" : "\uD558\uC9C0\uB9CC \uC815\uB9D0 \uC5EC\uB7EC\uAC00\uC9C0\uB97C \uD310\uB2E8\uD569\uB2C8\uB2E4. \uAC15\uC81C\uCD94\uD589 \uBFD0\uB9CC\uC774 \uC544\uB2C8\uB77C \uBAA8\uB4E0 \uBC94\uC8C4\uAC00 \uADF8\uB807\uAC8C \uAE30\uACC4\uC801\uC73C\uB85C \uB531\uB531 \uACF5\uC2DD \uB300\uC785\uD574\uC11C \uD310\uB2E8\uD558\uB294\uAC70 \uC544\uB2C8\uC608\uC694..\n\n'\uAD6C\uC131\uC694\uAC74\uC5D0 \uD574\uB2F9\uD558\uACE0 \uC704\uBC95\uD558\uBA70 \uCC45\uC784\uC788\uB294 \uD589\uC704' \uB77C\uB294 3\uB2E8\uACC4 \uCCB4\uACC4\uC5D0 \uB530\uB77C\uC11C \uBC94\uC8C4 \uC5EC\uBD80\uB97C \uB530\uC838\uBCF4\uACE0, \uAC70\uAE30\uC5D0\uB2E4\uAC00 \uC774\uAC83\uC774",
