  "text" : "\uD0DD\uC2DC\uAE30\uC0AC\uAC00 \uD55C\uBC24\uC911\uC5D0 \uC5B4\uB450\uC6B4 \uD0DD\uC2DC \uC548\uC5D0\uC11C \uC5EC\uC790\uC2B9\uAC1D\uC5D0\uAC8C \uC694\uAE08\uC744 \uAC70\uC2AC\uB7EC \uC8FC\uB2E4\uAC00 \uC5EC\uC790 \uC2B9\uAC1D\uC758 \uC190\uC744 \uC7A1\uC558\uB294\uB370, \uC5EC\uC790\uC2B9\uAC1D\uC774 \uADF8\uAC8C \uBD88\uCF8C\uD558\uB2E4\uBA70 \uD0DD\uC2DC\uAE30\uC0AC\uB97C \uAC15\uC81C\uCD94\uD589 \uD610\uC758\uB85C \uC2E0\uACE0\uD588\uC8E0.\n\n\uAE30\uACC4\uC801\uC73C\uB85C \"\uC190\uC744 \uB314\uB2E4 = \uC131\uCD94\uD589\uC774\uB2E4\" \uB17C\uB9AC\uB85C \uC811\uADFC\uD558\uC2DC\uB294 \uBD84\uB4E4\uC774\uB77C\uBA74 \uACB0\uB860\uC774 \uBED4\uD558\uC8E0?",
