  "text" : "\"\uC190\uB314\uB2E4 = \uBB34\uC870\uAC74 \uC131\uCD94\uD589\uC774\uB2E4\" \uC774\uB7F0 \uB17C\uB9AC\uB97C \uD3B4\uC2DC\uB294 \uBD84\uB4E4\uC774 \uC788\uB294\uB370, \uADF8\uB7F0 \uC5B5\uC9C0 \uC548\uD1B5\uD558\uC9C0 \uB9D0\uC785\uB2C8\uB2E4.. \uADF8\uB807\uAC8C \uAE30\uACC4\uC801\uC73C\uB85C \uD310\uB2E8\uD560 \uAC83\uC774\uB77C\uBA74 \uC7AC\uD310\uC740 \uC65C \uD544\uC694\uD558\uBA70, \uBC95\uAD00\uC740 \uC65C \uD544\uC694\uD558\uACA0\uC5B4\uC694. \uC0AC\uC2E4\uAD00\uACC4\uB3C4 \uB530\uC838\uBCF4\uACE0, \uC5EC\uB7EC\uAC00\uC9C0 \uC0C1\uD669\uC744 \uB450\uB8E8\uB450\uB8E8 \uC0B4\uD3B4\uBCF4\uACE0 \uD310\uB2E8\uD558\uB294\uAC70\uC9C0..",
