  "text" : "\uC808\uB3C4\uC728\uC5D0 \uAC00\uC7A5 \uD070 \uC601\uD5A5\uC744 \uBBF8\uCE5C\uB2E4\uACE0 \uBCF4\uACE0\uD558\uBA70, \uBC94\uC8C4\uC758 \uD2B9\uC131\uC5D0 \uB530\uB77C \uC601\uD5A5\uC744 \uBBF8\uCE58\uB294 \uC8FC\uC694 \uBCC0\uC778\uC774 \uB2E4\uB984\uC744 \uAC15\uC870\uD558\uC600\uB2E4.\r\uB2E8\uC21C\uD788 \uC0AC\uBC95\uC815\uCC45\uC758 \uAC15\uACBD\uD654\uC640 \uBC94\uC8C4\uC5D0 \uB300\uD55C \uC5C4\uACA9\uD55C \uB300\uC751\uB9CC\uC73C\uB85C\uB294 \uC131\uACA9\uC774 \uB2E4\uB978 \uC5EC\uB7EC \uC885\uB958\uC758 \uBC94\uC8C4\uB97C \uD6A8\uACFC\uC801\uC73C\uB85C \uC608\uBC29\uD560 \uC218 \uC5C6\uC74C\uC744 \uC2DC\uC0AC\uD558\uB294 \uAC83\uC774\uB2E4.",
