  "text" : "\uD558\uB098\uC774\uAE30\uB294 \uD558\uC9C0\uB9CC, \uBC94\uC8C4\uC728\uC774 \uC9C0\uC18D\uC801\uC73C\uB85C \uB0AE\uC740 \uC774\uC720\uB294 \uC544\uC9C1 \uBC1D\uD600\uC9C0\uC9C0 \uC54A\uC558\uB2E4\uB294 \uC758\uBBF8\uC774\uB2E4.\n\n\uB610 \uBBF8\uAD6D\uC758 \uBC94\uC8C4\uC728 \uAC10\uC18C \uB3D9\uD5A5\uC5D0 \uAD00\uD55C \uC6D0\uC778\uC744 \uBD84\uC11D\uD55C \uB2E4\uB978 \uC5F0\uAD6C\uB294 \uC774\uBBFC \uBE44\uC728\uACFC \uBC94\uC8C4\uC728 (\uD2B9\uD788 \uAC15\uB3C4\uC728)\uC774 \uC0C1\uAD00\uC774 \uC788\uB2E4\uACE0 \uBC1C\uD45C\uD558\uC600\uACE0, \uB610 \uB2E4\uB978 \uC5F0\uAD6C\uB294 \uBB3C\uAC00\uC640 \uAD6C\uAE08\uC728\uC774",
