  "text" : "\uC131\uAE09\uD55C \uBA74\uC774 \uC788\uB2E4.\r \uD50C\uB85C\uB9AC\uB2E4 \uC8FC \uBFD0\uB9CC \uC544\uB2C8\uB77C \uBBF8\uAD6D\uC758 \uBC94\uC8C4\uC728\uC774 2003-2004\uB144 \uC774\uD6C4 \uACC4\uC18D \uC77C\uC815\uD55C \uC218\uC900\uC73C\uB85C \uB0AE\uC740 \uC0C1\uD0DC\uC5D0 \uBA38\uBB3C\uACE0 \uC788\uB294 \uAC83\uC740 \uAD6C\uAE08\uC728\uC758 \uBCC0\uD654\uC640 \uC0C1\uAD00\uC774 \uC788\uB294 \uAC83\uC740 \uC544\uB2C8\uB2E4. \uC774\uB294 \uAD6C\uAE08\uC728\uC774 \uBC94\uC8C4\uC728 \uAC10\uC18C\uC5D0 \uC720\uC758\uBBF8\uD55C \uC601\uD5A5\uC744 \uBBF8\uCE58\uB294 \uC6D0\uC778\uC911",
