  "text" : "\uD50C\uB85C\uB9AC\uB2E4 \uC8FC\uC758 \uBC94\uC8C4\uC728\uC758 \uC9C0\uC18D\uC801\uC778 \uAC10\uC18C\uC640 \uADF8 \uC6D0\uC778\uC5D0 \uAD00\uD55C \uBD84\uC11D\uC774 \uD55C\uAD6D\uC758 \uD615\uC0AC\uC0AC\uBC95 \uC815\uCC45\uC5D0 \uC2DC\uC0AC\uD558\uB294 \uBC14\uB294 \uBD84\uBA85\uD788 \uC788\uB2E4. \uADF8\uB7EC\uB098 \uBE44\uC6A9\uC758 \uBB38\uC81C\uB97C \uB5A0\uB098\uC11C, \uB2E8\uC21C\uD788 \uAD6C\uAE08\uC728\uC744 \uB192\uC5EC \uBC94\uC8C4\uC5D0 \uB300\uC751\uD558\uB294 \uCC98\uBC8C\uC758 \uAC15\uACBD\uD654\uAC00 \uBC94\uC8C4 \uC608\uBC29\uC758 \uAC00\uC7A5 \uC911\uC694\uD55C \uBCC0\uC778\uC774\uB77C\uACE0 \uB2E8\uC815 \uC9D3\uAE30\uC5D0\uB294",
