  "text" : "\uC774 \uC5F0\uAD6C\uC758 \uD55C\uACC4 \uBC0F \uC2DC\uC0AC\uC810\uC5D0 \uB300\uD574 \uB2E4\uC2DC \uD55C \uBC88 \uC0DD\uAC01\uD574 \uBCFC \uD544\uC694\uAC00 \uC788\uB2E4.\n\n\uD50C\uB85C\uB9AC\uB2E4 \uBC94\uC8C4\uC728\uC758 \uAC10\uC18C\uB294 1990\uB144\uB300 \uC911\uBC18 \uC774\uD6C4 \uAFB8\uC900\uD788 \uAC10\uC18C \uCD94\uC138\uB97C \uBCF4\uC774\uACE0 \uC788\uB294 \uBBF8\uAD6D \uC804\uCCB4 \uBC94\uC8C4\uC728\uACFC \uADF8 \uD750\uB984\uC744 \uAC19\uC774 \uD55C\uB2E4. \uC774\uB294 \uD50C\uB85C\uB9AC\uB2E4 \uC8FC\uB97C \uD3EC\uD568\uD55C \uBBF8\uAD6D\uC758 \uAC15\uB825\uD55C \uBCF4\uD638\uCCA0\uD559\uC758",
