  "text" : "\uAC15\uB825\uBC94\uC8C4\uC728 \uBC0F \uC7AC\uC0B0\uBC94\uC8C4\uC728\uC758 \uAC10\uC18C\uC5D0 \uC720\uC758\uBBF8\uD55C \uC601\uD5A5\uC744 \uBBF8\uCE5C \uAC83\uC73C\uB85C \uBD84\uC11D\uB41C \uB2E8 \uD558\uB098\uC758 \uBCC0\uC778\uC740 \uC2DC\uC124\uC5D0 \uC218\uAC10\uB41C \uC218\uD615\uC790\uC758 \uC218\uC600\uB2E4. \uB17C\uB780\uC758 \uC5EC\uC9C0\uB294 \uC788\uC9C0\uB9CC, \uAC15\uB825\uD55C \uCC98\uBC8C \uC815\uCC45\uC758 \uD6A8\uACFC\uC131\uC744 \uC5B4\uB290 \uC815\uB3C4 \uC785\uC99D\uD558\uB294 \uC5F0\uAD6C \uACB0\uACFC\uC778 \uAC83\uC774\uB2E4. \uADF8\uB7EC\uB098 \uC774\uB7EC\uD55C \uACB0\uB860 \uB3C4\uCD9C\uC5D0 \uC55E\uC11C",
