  "text" : "\uCE58\uC720\uD560 \uC218 \uC5C6\uB294 \uACBD\uC6B0\uAC00 \uB9CE\uB2E4.\r\uC815\uB2F9\uD574\uC0B0\uC744 \uD1B5\uD574 \uC815\uCE58\uC801\uC778 \uACBD\uC7C1\uC790\uB294 \uBC30\uC81C\uD560 \uC218 \uC788\uC9C0\uB9CC \uC774\uB7EC\uD55C \uACBD\uC7C1\uC790\uAC00 \uB098\uC624\uAC8C \uB41C \uC6D0\uC778\uC744 \uD574\uACB0\uD560 \uC218\uB294 \uC5C6\uACE0 \uAE09\uC9C4\uC801\uC778 \uC774\uB150\uC744 \uCD94\uC885\uD558\uB294 \uC0AC\uB78C\uB4E4\uC758 \uC0DD\uAC01\uC744 \uBC14\uAFC0 \uC218\uB3C4 \uC5C6\uB2E4. \uC6D0\uC778\uC744 \uD574\uACB0\uD558\uC9C0 \uC54A\uACE0 \uC815\uB2F9\uB9CC\uC744 \uBC30\uC81C\uD558\uB294 \uACBD\uC6B0\uC5D0",
