  "text" : "\uBC94\uC8C4\uC5D0 \uB300\uD55C \uB450\uB824\uC6C0\uC5D0 \uC9D1\uB2E8\uC704\uD611\uC774\uB860\uC744 \uC801\uC6A9\uD55C \uC5F0\uAD6C\uB4E4\uC740 \uC18C\uC218\uBBFC\uC871\uACFC\uC758 \uADFC\uC811\uC131\uC774 \uBC94\uC8C4\uC5D0 \uB300\uD55C \uB450\uB824\uC6C0\uC744 \uC99D\uAC00\uC2DC\uD0A4\uACE0 \uC774\uB85C \uC778\uD574 \uCC98\uBC8C\uC801 \uB300\uC751\uC774 \uAC15\uD654\uB41C\uB2E4\uB294 \uAC00\uC124\uC744 \uAC80\uC99D\uD588\uB2E4. \uB300\uB2E4\uC218\uC758 \uC5F0\uAD6C\uC5D0\uC11C \uAC1D\uAD00\uC801\uC778 \uC18C\uC218\uC778\uC885\u2024\uBBFC\uC871 \uC778\uAD6C\uC758 \uADDC\uBAA8\uBFD0\uB9CC \uC544\uB2C8\uB77C \uB0B4\uAD6D\uC778\uB4E4\uC774 \uC8FC\uAD00\uC801\uC73C\uB85C \uB290\uB07C\uB294",
