  "text" : "\uBC94\uC8C4\uBC1C\uC0DD\uC758 \uAC00\uB2A5\uC131\uC774 \uC99D\uAC00\uD588\uB2E4\uACE0 \uC778\uC2DD\uD558\uAC8C \uB41C\uB2E4. \uC774\uB7EC\uD55C \uBC18\uC751\uC740 \uC9C0\uC5ED\uC0AC\uD68C\uB0B4\uC758 \uC0AC\uD68C\uD1B5\uC81C \uC218\uB2E8(\uC608\uB97C \uB4E4\uC5B4 \uACBD\uCC30\uB825)\uC744 \uBCF4\uB2E4 \uC801\uADF9\uC801\uC73C\uB85C \uD65C\uC6A9\uD558\uB3C4\uB85D \uC694\uAD6C\uD558\uB294 \uC5EC\uB860\uC758 \uD615\uC131, \uB098\uC544\uAC00 \uACBD\uCC30\uB825\uC758 \uBCF4\uAC15\uC774\uB098 \uAC15\uB825\uD55C \uBC95\uC9D1\uD589\uC73C\uB85C \uC774\uC5B4\uC9C0\uAC8C \uB418\uB294 \uAC83\uC774\uB2E4.",
