  "text" : "\uB0B4\uAD6D\uC778\uB4E4\uC758 \uAC10\uC815\uC801 \uB610\uB294 \uC778\uC9C0\uC801 \uBC18\uC751\uC758 \uACB0\uACFC\uB85C \uD574\uC11D\uD560 \uC218 \uC788\uB2E4.\n\n\uB2E4\uC2DC \uB9D0\uD558\uBA74 \uAC70\uC8FC\uC9C0\uC5ED\uB0B4\uC5D0 \uC774\uC9C8\uC801\uC778 \uC9D1\uB2E8\uC758 \uADDC\uBAA8\uAC00 \uC99D\uAC00\uD558\uACE0 \uC774\uB4E4\uACFC\uC758 \uBB3C\uB9AC\uC801 \uAC70\uB9AC\uAC00 \uC904\uC5B4\uB4E4\uAC8C \uB418\uBA74 \uB0B4\uAD6D\uC778\uB4E4\uC740 \uAC10\uC815\uC801\uC778 \uCE21\uBA74\uC5D0\uC11C \uBC94\uC8C4\uC5D0 \uB300\uD55C \uB450\uB824\uC6C0\uC744 \uB290\uB07C\uAC70\uB098 \uC778\uC9C0\uC801\uC778 \uCE21\uBA74\uC5D0\uC11C",
