  "text" : "\uACF5\uC2DD\uC801\u00B7\uBE44\uACF5\uC2DD\uC801 \uC0AC\uD68C\uD1B5\uC81C \uBA54\uCEE4\uB2C8\uC998 \uC0AC\uC774\uC758 \uC0C1\uAD00\uAD00\uACC4\uC5D0 \uCD08\uC810\uC744 \uB9DE\uCD94\uC5C8\uB2E4. \uC774\uB4E4 \uC5F0\uAD6C \uACB0\uACFC\uC5D0 \uC758\uD558\uBA74 \uC0C1\uB300\uC801\uC73C\uB85C \uD751\uC778\uC778\uAD6C\uAC00 \uB9CE\uC774 \uAC70\uC8FC\uD558\uB294 \uC9C0\uC5ED\uC77C\uC218\uB85D \uACBD\uCC30\uB825\uC758 \uADDC\uBAA8\uAC00 \uD06C\uAC70\uB098, \uCCB4\uD3EC\uC728\uC774 \uB192\uAC70\uB098, \uACBD\uCC30\uC758 \uBB3C\uB9AC\uB825\uC0AC\uC6A9 \uBE48\uB3C4\uAC00 \uB192\uAC70\uB098, \uAD50\uC815\uC2DC\uC124\uC5D0 \uAD6C\uAE08\uB420 \uAC00\uB2A5\uC131\uC774",
